INSERT INTO `textpattern` (`ID`, `Posted`, `AuthorID`, `LastMod`, `LastModID`, `Title`, `Title_html`, `Body`, `Body_html`, `Excerpt`, `Excerpt_html`, `Image`, `Category1`, `Category2`, `Annotate`, `AnnotateInvite`, `comments_count`, `Status`, `textile_body`, `textile_excerpt`, `Section`, `override_form`, `Keywords`, `url_title`, `custom_1`, `custom_2`, `custom_3`, `custom_4`, `custom_5`, `custom_6`, `custom_7`, `custom_8`, `custom_9`, `custom_10`, `uid`, `feed_time`) VALUES (4,'2006-02-24 16:46:00','dragon','2008-08-20 23:57:23','dragon','Prima participare la întâlnirea motocicliştilor din Cluj','','Ieri seară am participat pentru prima dată la întâlnirea motocicliştilor din Cluj.\r\nDeşi încă nu am motocicletă, am considerat că este cazul să iau contact cu oameni mai experimentaţi care să mă ghideze la începutul experienţei mele ca motociclist.\r\n\r\nCăutând pe internet informaţii despre motociclete am găsit şi site-ul \"www.motociclism.ro\":http://www.motociclism.ro al cărui forum reuneşte o comunitate foarte activă şi unde am găsit multe informaţii utile.\r\nPe forum am cunoscut şi câţiva motociclişti din Cluj care din discuţii am înţeles că se întâlnesc în fiecare săptămână.\r\n\r\nLuându-mi inima în dinţi i-am întrebat dacă acceptă printre ei şi un novice care încă e pieton.\r\nSpre bucuria mea au fost foarte primitori şi uite aşa „am aterizat”  ieri seară în „Fox”, barul lui Shak, fără să cunosc pe nimeni şi neştiind la ce să mă aştept.\r\n\r\nPrimul pe care l-am cunoscut a fost Shak, care tocmai se întorsese de la Braşov şi a scos o medie de 100 km/h între Braşov şi Cluj ca să ajungă la timp la întâlnire.\r\nSpre uşurarea mea mai era un tip care venise pentru prima dată aşa că nu m-am simţit aşa stingher.\r\n\r\nAu început să apară şi ceilalţi şi trecând peste fazele de început, care sunt întotdeauna puţin stânjenitoare, în scurt timp am simţit că mă integrez în atmosferă.\r\nBineînţeles că la început toate discuţiile erau despre motociclete, unde eu mai mult ascultam şi  încercam să bag la cap, dar după un timp s-a trecut de la chestiile pur tehnice şi am reuşit să mai schimb şi eu o vorbă două.\r\n\r\nFoarte interesantă şi educativă pentru mine a fost şi discuţia cu Galen care pe lângă descrierea calităţilor şi defectelor Hondei CB 500 (motocicleta care doresc să o cumpăr)  mi-a dat şi câteva sfaturi privind măsurile de siguranţă pe care trebuie să le am în vedere când mă aflu la ghidonul motocicletei.\r\n\r\nUnul dintre momentele de atracţie ale serii a fost prezentarea de către Mişi a unor filmuleţe de la concursuri enduro şi a pozelor făcute de el la o expoziţie de motociclete în S.U.A.\r\nPozele şi filmuleţele au fost interesante, iar comentariile lui Mişi savuroase.\r\n\r\nÎn concluzie a fost o seară reuşită, băieţii şi fetele au reuşit să mă facă să mă simt ca şi unul de-al lor şi sper să urmeze cât de multe întâlniri ca aceasta.','	<p>Ieri seară am participat pentru prima dată la întâlnirea motocicliştilor din Cluj.<br />\nDeşi încă nu am motocicletă, am considerat că este cazul să iau contact cu oameni mai experimentaţi care să mă ghideze la începutul experienţei mele ca motociclist.</p>\n	<p>Căutând pe internet informaţii despre motociclete am găsit şi site-ul <a href=\"http://www.motociclism.ro\">www.motociclism.ro</a> al cărui forum reuneşte o comunitate foarte activă şi unde am găsit multe informaţii utile.<br />\nPe forum am cunoscut şi câţiva motociclişti din Cluj care din discuţii am înţeles că se întâlnesc în fiecare săptămână.</p>\n	<p>Luându-mi inima în dinţi i-am întrebat dacă acceptă printre ei şi un novice care încă e pieton.<br />\nSpre bucuria mea au fost foarte primitori şi uite aşa „am aterizat”  ieri seară în „Fox”, barul lui Shak, fără să cunosc pe nimeni şi neştiind la ce să mă aştept.</p>\n	<p>Primul pe care l-am cunoscut a fost Shak, care tocmai se întorsese de la Braşov şi a scos o medie de 100 km/h între Braşov şi Cluj ca să ajungă la timp la întâlnire.<br />\nSpre uşurarea mea mai era