xtpattern/setup/index.php\r\n\r\nDe aici configurarea a deveni extrem de simplă, nu a trebuit decât să introduc informaţiile necesare pentru conectarea la baza de date creată anterior şi să confirm calea către directorul rădăcină şi directorul textpattern.\r\nA urmat crearea unui cont iar apoi scriptul a făcut toată treaba de iniţializare a spaţiului de lucru. \r\nGata!\r\n\r\nDupă logare am fost plăcut surprins de o interfaţa de administrare prietenoasă, ergonomică şi intuitivă.\r\nÎntr-un timp extrem de scurt am reuşit să public primul meu articol.\r\n\r\nAcum că totul funcţiona am considerat că e necesară personalizarea prezentării conţinutului, aşa că după ce am petrecut ceva timp căutând pe Internet am găsit un layout care mi-a plăcut şi m-am hotărât să-l implementez blog-ului meu.\r\n\r\nAici trebuie să recunosc că nu am reuşit din prima încercare.\r\nImplementarea unui nou layout, după cum am descoperit şi eu, poate fi anevoioasă şi frustrantă aşa că e nevoie de puţină răbdare.\r\nPresupun că datorită dorinţei celor care au scris scriptul de a oferii un grad mare de customizare al modului de prezentare al conţinutului, procesul de implementare al unui nou layout are nevoie de mai mulţi paşi făcuţi într-o succesiune corectă.\r\nOricum a doua încercare a fost norocoasă, rezultatul îl vedeţi şi voi şi sper că va place.\r\n\r\nÎn concluzie Textpattern este, după părerea mea, o soluţie excelentă pentru cei care doresc un CMS flexibil, elegant, uşor de folosit şi extrem de customizabil.','	<p>De ceva vreme mă tot bătea gândul să configurez un subdomeniu pe care să îl folosesc pentru un blog personal.<br />\nIeri am reuşit să-mi fac puţin timp liber pentru a face un studiu comparativ al celor mai cunoscute script-uri open source care au această funcţionalitate.<br />\nPână la urmă m-am oprit la Textpattern şi acum pot spune că nu regret.</p>\n	<p>Instalarea scriptului a fost extrem de simplă:\n	<ol>\n		<li>crearea unei baze de date mysql</li>\n		<li>crearea unui subdomeniu</li>\n		<li>copierea fişierelor downloadate de la <a href=\"http://textpattern.com/download\">http://textpattern.com/download</a> în directorul subdomeniului</li>\n		<li>accesarea paginii http://subdomeniu/textpattern/setup/index.php</li>\n	</ol></p>\n	<p>De aici configurarea a deveni extrem de simplă, nu a trebuit decât să introduc informaţiile necesare pentru conectarea la baza de date creată anterior şi să confirm calea către directorul rădăcină şi directorul textpattern.<br />\nA urmat crearea unui cont iar apoi scriptul a făcut toată treaba de iniţializare a spaţiului de lucru. <br />\nGata!</p>\n	<p>După logare am fost plăcut surprins de o interfaţa de administrare prietenoasă, ergonomică şi intuitivă.<br />\nÎntr-un timp extrem de scurt am reuşit să public primul meu articol.</p>\n	<p>Acum că totul funcţiona am considerat că e necesară personalizarea prezentării conţinutului, aşa că după ce am petrecut ceva timp căutând pe Internet am găsit un layout care mi-a plăcut şi m-am hotărât să-l implementez blog-ului meu.</p>\n	<p>Aici trebuie să recunosc că nu am reuşit din prima încercare.<br />\nImplementarea unui nou layout, după cum am descoperit şi eu, poate fi anevoioasă şi frustrantă aşa că e nevoie de puţină răbdare.<br />\nPresupun că datorită dorinţei celor care au scris scriptul de a oferii un grad mare de customizare al modului de prezentare al conţinutului, procesul de implementare al unui nou layout are nevoie de mai mulţi paşi făcuţi într-o succesiune corectă.<br />\nOricum a doua încercare a fost norocoasă, rezultatul îl vedeţi şi voi şi sper că va place.</p>\n	<p>În concluzie Textpattern este, după părerea mea, o soluţie excelentă pentru cei care doresc un CMS flexibil, elegant, uşor de folosit şi extrem de customizabil.</p>\n\n ','De ceva vreme mă tot bătea gândul să configurez un subdomeniu pe care să îl folosesc pentru un blog personal.\r\nIeri am reuşit să-mi fac puţin timp liber pentru a face un studiu comparativ al celor mai cunoscute 