>XHTML</li>\n		<li>MySQL\n		<li>PostgreSQL<br />\n</ol><br />\n<h3>Foreign Languages</h3><br />\n<ol>\n		<li>english &#8211; medium level</li>\n		<li>german &#8211; beginner level\n		<li>french &#8211; beginner level <br />\n</ol><br />\n<h3>Hobby</h3><br />\n\nI love traveling, riding motorcycles, reading a good book, hacking on my linux box and discover new ways of using existent technologies in day to day life.</p>\n\n\n ','','\n\n ','','','',0,'Comentarii',0,4,1,1,'cv','','','curriculum-vitae','','','','','','','','','','','5ae57b5b599de4747bf2491d4d5fcbda','2006-02-26'),(24,'2010-07-27 22:05:00','mihai','2010-07-27 22:13:50','mihai','Connect external monitor to Sony Vaio F Series laptop','','My second attempt to configure my old Dell 1905FP TFT monitor as an external display to my new Sony Vaio F Series running Ubuntu 10.04 was successful so I decided to share my configuration maybe will help someone to spare some time.\r\n\r\nThe Sony Vaio F Series laptop comes with nVidia GeForce GT 330M video card. The first problem I encounter right after Ubuntu and nVidia proprietary driver installation, the laptop monitor was not correctly detected. Adding the following two lines in the device section of the xorg.conf file solved the problem:\r\n\r\n*Option         \"ConnectedMonitor\" \"DFP-0\"*\r\n*Option         \"CustomEDID\" \"DFP-0: /proc/acpi/video/NGFX/LCD/EDID\"*\r\n\r\nThe native resolution of the laptop monitor was recognized and all was working fine.\r\n\r\nI then attached the Dell monitor using a VGA cable and fired up the nvidia-settings utility. The monitor was not recognized, so I start to search a solution. None of them worked. At one moment I could get either one of the monitors to work, but not both of them simultaneously.\r\n\r\nIn the end the solution was quite simple, I changed\r\n*Option         \"ConnectedMonitor\" \"DFP-0\"*\r\nto\r\n*Option         \"ConnectedMonitor\" \"DFP-0, CRT\"*\r\n\r\nAn then I added\r\n*Option         \"UseDisplayDevice\" \"DFP-0\"*\r\nin the same device section of the xorg.conf file\r\n\r\nWhat the changes mean? Adding CRT to ConnectedMonitor option forced recognition of the external monitor. UseDisplayOption tells X server which monitor to use by default.\r\n\r\nAfter X server restart the external monitor was detected and I was able to set it up with the nvidia-settings utility. Here is my entire \"xorg.conf\":files/xorg.conf file.\r\n\r\nHope this information was helpful, please let me know if this solution worked for you.','	<p>My second attempt to configure my old Dell 1905FP TFT monitor as an external display to my new Sony Vaio F Series running Ubuntu 10.04 was successful so I decided to share my configuration maybe will help someone to spare some time.</p>\n	<p>The Sony Vaio F Series laptop comes with nVidia GeForce GT 330M video card. The first problem I encounter right after Ubuntu and nVidia proprietary driver installation, the laptop monitor was not correctly detected. Adding the following two lines in the device section of the xorg.conf file solved the problem:</p>\n	<p><strong>Option         &#8220;ConnectedMonitor&#8221; &#8220;DFP-0&#8221;</strong><br />\n<strong>Option         &#8220;CustomEDID&#8221; &#8220;DFP-0: /proc/acpi/video/NGFX/LCD/EDID&#8221;</strong></p>\n	<p>The native resolution of the laptop monitor was recognized and all was working fine.</p>\n	<p>I then attached the Dell monitor using a VGA cable and fired up the nvidia-settings utility. The monitor was not recognized, so I start to search a solution. None of them worked. At one moment I could get either one of the monitors to work, but not both of them simultaneously.</p>\n	<p>In the end the solution was quite simple, I changed<br />\n<strong>Option         &#8220;ConnectedMonitor&#8221; &#8220;DFP-0&#8221;</strong><br />\nto<br />\n<strong>Option         &#8220;ConnectedMonitor&#8221; &#8220;DFP-0, CRT&#8221;</strong></p>\n	<p>An then I added<br />\n<strong>Option         &#8220;UseDisplayDevice&#8221; &#8220;DFP-0&#8221;</strong><br />\nin the same device section of the xorg.conf file</p>\n	<p>What the changes mean? Adding CRT to ConnectedMonitor option forced recognition of the external monitor. UseDisplayOption tells X server which monitor to use by default.</p>\n	<p>After X server restart the external monitor was detected and I was able to set it up with the nvidia-settings utility. Here is my entire <a href=\"http://mihai.frisan.ro/files/xorg.conf\">xorg.conf</a> file.</p>\n	<p>Hope this information was helpful, please let me know if this solution worked for you.</p>\n\n ','My second attempt to configure my old Dell 1905FP TFT monitor as an external display to my new Sony Vaio F Series running Ubuntu 10.04 was successful so I decided to share my configuration maybe will help someone to spare some time.','	<p>My second attempt to configure my old Dell 1905FP TFT monitor as an external display to my new Sony Vaio F Series running Ubuntu 10.04 was successful so I decided to share my configuration maybe will help someone to spare some time.</p>\n\n ','','linux','linux',1,'Comments',0,4,1,1,'article','','','connect-external-monitor-to-sony-vaio-f-series-laptop','','','','','','','','','','','396b394421ce9cc7a48ad8c9f2344880','2010-07-27'),(12,'2006-01-01 00:00:00','dragon','2008-08-23 20:31:54','dragon','Portfolio','','h3. <a href=\"#\" target=\"_blank\">eBarKeeper</a>\r\n\r\n# restaurant management software that gives clients the maximum benefits of a totally integrated POS management system. Restaurant inventory software and restaurant accounting software combined with restaurant menu software give the restaurant manager complete control of all business operations. \r\n\r\nh3. <a href=\"http://www.thespaassociation.com\" target=\"_blank\">The SPA Association</a>\r\n\r\n# SPA community web portal\r\n\r\nh3. <a href=\"http://www.ladadezestre.com\" target=\"_blank\">Lada de zestre</a>\r\n\r\n# e-commerce application designed for selling romanian traditional ob