 legea este clară: pe durata anchetei penale poliţistul trebuie suspendat din funcţie,  cel implicat în accidentul mortal al lui Alex este în continuare în funcţie şi este în postura de a influenţa ancheta. \r\n\r\nSingura explicaţie pe care o găsesc este faptul că se încearcă muşamalizarea cazului.\r\nProbabil se aşteaptă până cazul iese din atenţia publică pentru a invoca cine ştie ce vicii de procedură sau a folosii alte tertipuri pentru a-l scoate basma curată pe poliţist.\r\nPrin acţiunea iniţiată de motocicliştii din Bucureşti şi prin marşul care va avea loc in capitală încercăm să menţinem în atenţia opiniei publice acest caz şi sa urgentăm soluţionarea dosarului şi trimiterea lui în instanţă.\r\n\r\nMai multe detalii privind circumstanţele producerii accidentului le puteţi afla <a href=\"http://www.curierulnational.ro/?page=articol&editie=544&art=40198\" target=\"_blank\">aici</a>.','	<p>Ieri mi-am adus si eu contribuţia, printr-o simplă semnătură, la o acţiune iniţiată de un grup de motociclişti din Bucureşti şi susţinută de întreaga comunitate pentru strângerea de semnături în vederea depunerii unei petiţii prin care solicităm urgentarea anchetei şi trimiterea în instanţă a dosarului privind moartea lui Alex, precum şi suspendarea din funcţie pe durata anchetei a poliţistului implicat.</p>\n	<p>Deşi deja m-am obişnuit cu mocirla din justiţia română şi credeam că nimic nu mă mai poate şoca, mi se pare inadmisibil ca după doi ani de la producerea accidentului acest dosar să nu ajungă în instanţă. <br />\nNu înţeleg cum poate o anchetă într-un asemenea caz, atât de evident pentru toată lumea, să dureze doi ani. <br />\nTrebuie să precizez că deşi legea este clară: pe durata anchetei penale poliţistul trebuie suspendat din funcţie,  cel implicat în accidentul mortal al lui Alex este în continuare în funcţie şi este în postura de a influenţa ancheta. </p>\n	<p>Singura explicaţie pe care o găsesc este faptul că se încearcă muşamalizarea cazului.<br />\nProbabil 