ism.ro/forum/index.php?showtopic=38326 superbe pe motoare. \r\n\r\nCe mă încântă cel mai mult este faptul că de fiecare dată, indiferent daca sunt stresat, nervos sau obosit, când urc pe motocicletă am aceeaşi senzaţie de bucurie şi libertate, iar când cobor sunt relaxat si bine dispus.\r\n\r\nDespre motocicletă doar cuvinte de laudă: manevrabilitate excelentă, poziţie de condus comodă (am făcut un drum de 500 km fără nici o problemă), rezervă de putere impresionantă (abia când trece de 6.000 rpm parcă se trezeşte motorul la viaţă), frâne bune, ţinută de drum impecabilă. Este o motocicletă ideala pentru începători, părerea mea, dar nu prea îi plac drumurile proaste şi din păcate astea le-avem astea le folosim. Din acest motiv mă gândesc deja la următoarea motocicletă, ceva soft enduro, probabil o să aleg între BMW F650 GS Dakar şi KTM 640 Adventure. Oricum încă mai am timp să mă hotărăsc abia la anul mi-am propus sa schimb motorul, deocamdată doar prospectez.\r\n\r\nÎn concluzie vreau sa spun că motociclismul mi-a întrecut orice aşteptări şi mă bucur că am reuşit să-mi îndeplinesc încă un vis din tinereţe, iar senzaţiile trăite au depăşit şi cele mai îndrăzneţe previziuni.\r\n','	<p>Parcă ieri scriam articolul despre prima întâlnire cu motocicliştii din Cluj. Ei bine între timp am devenit fericitul posesor al unei Honda CB500 şi am făcut mai bine de 5.000 km pe motocicletă. În acest timp am cunoscut câţiva oameni extraordinari cu care am făcut <a href=\"http://www.motociclism.ro/forum/index.php?showtopic=38326\">ieşiri</a> superbe pe motoare. </p>\n	<p>Ce mă încântă cel mai mult este faptul că de fiecare dată, indiferent daca sunt stresat, nervos sau obosit, când urc pe motocicletă am aceeaşi senzaţie de bucurie şi libertate, iar când cobor sunt relaxat si bine dispus.</p>\n	<p>Despre motocicletă doar cuvinte de laudă: manevrabilitate excelentă, poziţie de condus comodă (am făcut un drum de 500 km fără nici o problemă), rezervă de putere impresionantă (abia când tre