e, afară era încă zăpadă, aşa că nu-mi făceam iluzii la o ieşire în timp scurt.\r\n\r\nDuminică sună Solo, băiat de cuvânt să mă cheme la căţărare, eu eram în Baia-Mare la botezul fiului unor prieteni. Mormăi în barba câteva cuvinte nu prea ortodoxe şi îi explic lui Solo situaţia. Simţind probabil dezamăgirea din vocea mea îmi promite că mai facem o ieşire pe luni. \r\n\r\nLuni mă sună şi pe la 12 plecăm cu încă un prieten spre Cheile Tureniului. Din nou ghinion, pe la jumătatea drumului începe să plouă. \r\nDacă tot ne-am pornit am făcut o vizită la salina din Turda şi fiindcă ploaia nu dădea semene ca vrea să se oprească ne-am întors acasă.\r\n\r\nMarţi, în sfârşit, pe o vreme superbă am ajuns în Cheile Tureniului. \r\nBăieţii s-au apucat de despachetat, s-au echipat şi cat ai clipii unul din ei era deja pe perete. Nici n-am apucat sa-mi revin din uimire şi Solo, care făcuse şi el o urcare, îmi întinde hanul şi-mi explică cum să-l pun şi fără prea multe discuţii mă împinge spre perete.\r\nAm început şovăielnic, mulţumind în gând pentru cele câteva kilograme pierdute în timpul primăverii, să urc pe peretele de piatră. Era un traseu de dificultate 6, deci ceva accesibil, dar mie mi s-a părut extrem de dificil, cel puţin la început până am căpătat puţină încredere în mine. Din păcate nu am reuşit sa urc până în vârf, m-am împotmolit undeva pe la 2/3 din traseu, aveam pantofi de sport în picioare şi nu avem nici un fel de aderenţa cu ei pe stâncă. \r\nCu tot botezul primit la coborâre de la Solo (cine a mai făcut căţărare ştie despre ce e vorba) şi faptul că nu am reuşit sa urc până în capăt, când am ajuns jos eram fericit; extenuat, dar fericit.\r\nPână mi-am recăpătat respiraţia şi am început sa-mi controlez tremuratul braţelor şi picioarelor băieţii deja strânseseră echipamentul şi am pornit spre alt perete.\r\nAcolo am avut 2 căţărări reuşite, e drept pe un traseu de dificultate 5+.\r\n\r\nFiindcă toţi aveam alte treburi după-masă pe la ora 16.00 ne-am întors în Cluj.\r\n Pe drumul de întoarcere aveam un sentiment de bucurie şi împlinire, iar zâmbetul nu mi s-a şters de pe faţă toată ziua.\r\n','	<p>De ceva vreme doream să încerc căţărarea pe stâncă, dar din lipsă de echipament şi cunoştinţe nu am reuşit să-mi îndeplinesc dorinţa.</p>\n	<p>Într-o seara fiind în vizita la Solo am observat că pe un perete avea echipament de căţărare. Încolţit n-a avut ce face a recunoscut că se mai căţăra din când în când pe stâncă şi a trebuit să-mi promită că la următoarea căţărare mă ia şi pe mine. <br />\nAsta era prin martie, afară era încă zăpadă, aşa că nu-mi făceam iluzii la o ieşire în timp scurt.</p>\n	<p>Duminică sună Solo, băiat de cuvânt să mă cheme la căţărare, eu eram în Baia-Mare la botezul fiului unor prieteni. Mormăi în barba câteva cuvinte nu prea ortodoxe şi îi explic lui Solo situaţia. Simţind probabil dezamăgirea din vocea mea îmi promite că mai facem o ieşire pe luni. </p>\n	<p>Luni mă sună şi pe la 12 plecăm cu încă un prieten spre Cheile Tureniului. Din nou ghinion, pe la jumătatea drumului începe să plouă. <br />\nDacă tot ne-am pornit am făcut o vizită la salina din Turda şi fiindcă ploaia nu dădea semene ca vrea să se oprească ne-am întors acasă.</p>\n	<p>Marţi, în sfârşit, pe o vreme superbă am ajuns în Cheile Tureniului. <br />\nBăieţii s-au apucat de despachetat, s-au echipat şi cat ai clipii unul din ei era deja pe perete. Nici n-am apucat sa-mi revin din uimire şi Solo, care făcuse şi el o urcare, îmi întinde hanul şi-mi explică cum să-l pun şi fără prea multe discuţii mă împinge spre perete.<br />\nAm început şovăielnic, mulţumind în gând pentru cele câteva kilograme pierdute în timpul primăverii, să urc pe peretele de piatră. Era un traseu de dificultate 6, deci ceva accesibil, dar mie mi s-a părut extrem de dificil, cel puţin la început până am căpătat puţină încredere în mine. Din păcate nu am reuşit sa urc până în vârf, m-am împotmolit undeva pe la 2/3 din traseu, aveam pantofi de sport în picioare şi nu avem nici un fel de aderenţa cu ei pe stâncă. <br />\nCu tot botezul primit la coborâre de la Solo (cine a mai făcut căţărare ştie despre ce e vorba) şi faptul că nu am reuşit sa urc până în capăt, când am ajuns jos eram fericit; extenuat, dar fericit.<br />\nPână mi-am recăpătat respiraţia şi am început sa-mi controlez tremuratul braţelor şi picioarelor băieţii deja strânseseră echipamentul şi am pornit spre alt perete.<br />\nAcolo am avut 2 căţărări reuşite, e drept pe un traseu de dificultate 5+.</p>\n	<p>Fiindcă toţi aveam alte treburi după-masă pe la ora 16.00 ne-am întors în Cluj.\n Pe drumul de întoarcere aveam un sentiment de bucurie şi împlinire, iar zâmbetul nu mi s-a şters de pe faţă toată ziua.</p>\n\n\n ','De ceva vreme doream să încerc căţărarea pe stâncă, dar din lipsă de echipament şi cunoştinţe nu am reuşit să-mi îndeplinesc dorinţa.\r\nÎntr-o seara fiind în vizita la Solo am observat că pe un perete avea echipament de căţărare. Încolţit n-a avut ce face a recunoscut că se mai căţăra din când în când pe stâncă şi a trebuit să-mi promită că la următoarea căţărare mă ia şi pe mine. ','	<p>De ceva vreme doream să încerc căţărarea pe stâncă, dar din lipsă de echipament şi cunoştinţe nu am reuşit să-mi îndeplinesc dorinţa.<br />\nÎntr-o seara fiind în vizita la Solo am observat că pe un perete avea echipament de căţărare. Încolţit n-a avut ce face a recunoscut că se mai căţăra din când în când pe stâncă şi a trebuit să-mi promită că la următoarea căţărare mă ia şi pe mine. </p>\n\n ','','outdoor-activities','outdoor-activities',1,'Comments',1,4,1,1,'article','','','prima-caarare-pe-stanca','','','','','','','','','','','9a5312b6971126c74b1de9a7b358f76b','2006-06-03'),(16,'2007-03-16 13:15:00','dragon','2008-08-20 23:56:09','dragon','Am facut upgrade! De la CB 500 la V-Strom 1000','','Aproximativ în aceeaşi perioadă, anul trecut, reuşeam să cumpăr prima mea motocicletă (Honda CB 500).\r\nA fost o motocicletă  excelentă pentru mine ca începător, efectiv nu am decât cuvinte de laudă pt. acest motor. Am făcut împreună anul trecut 15.000 km şi nu m-a lăsat niciodată, chiar mai mult, de multe ori m-a salvat din situaţii periculoase.\r\nDar iată că a venit vremea la un upgrade.\r\nDupa multe căutari pe net, citit de review-uri, întrebat în stanga şi în dreapta, m-am decis la un Suzuki V-Strom DL 1000.\r\nMotocicleta am cumparat-o din Germania şi mi-a fost adusă de un prieten din Bistriţa, care s-a ocupat şi de înmatriculare.  \r\nLa început am fost îngrijorat de faptul că motocicleta este mult mai înaltă si mai grea decât cea cu care eram obişnuit. M-am acomodat însă foarte repede, motocicleta este extrem de stabilă, foarte manevrabilă, având în vedere dimesiunile ei, şi se pretează excelent drumurilor de pe plaiurile mioritice.\r\nAm făcut deja 600 km si în continuare sunt uimit de puterea care o dezvoltă motorul, de cat de confortabila este poziţia în şa şi mai ales de cât de manevrabil este.\r\nSper să facem împreună câtmai mulţi kilometrii fără nici un incident neplacut. ','	<p>Aproximativ în aceeaşi perioadă, anul trecut, reuşeam să cumpăr prima mea motocicletă (Honda CB 500).<br />\nA fost o motocicletă  excelentă pentru mine ca începător, efectiv nu am decât cuvinte de laudă pt. acest motor. Am făcut împreună anul trecut 15.000 km şi nu m-a lăsat niciodată, chiar mai mult, de multe ori m-a salvat din situaţii periculoase.<br />\nDar iată că a venit vremea la un upgrade.<br />\nDupa multe căutari pe net, citit de review-uri, întrebat în stanga şi în dreapta, m-am decis la un Suzuki V-Strom DL 1000.<br />\nMotocicleta am cumparat-o din Germania şi mi-a fost adusă de un prieten din Bistriţa, care s-a ocupat şi de înmatriculare.  <br />\nLa început am fost îngrijorat de faptul că motocicleta este mult mai înaltă si mai grea decât cea cu care eram obişnuit. M-am acomodat însă foarte repede, motocicleta este extrem de stabilă, foarte manevrabilă, având în vedere dimesiunile ei, şi se pretează excelent drumurilor de pe plaiurile mioritice.<br />\nAm făcut deja 600 km si în continuare sunt uimit de puterea care o dezvoltă motorul, de cat de confortabila este poziţia în şa şi mai ales de cât de manevrabil este.<br />\nSper să facem împreună câtmai mulţi kilometrii fără nici un incident neplacut. </p>\n\n ','Iata că a venit vremea la un upgrade.\r\nDupa multe căutari pe net, citit de review-uri, întrebat în stanga si în dreapta m-am decis la un Suzuki V-Stom DL 1000.','	<p>Iata că a venit vremea la un upgrade.<br />\nDupa multe căutari pe net, citit de review-uri, întrebat în stanga si în dreapta m-am decis la un Suzuki V-Stom DL 1000.</p>\n\n ','','motoring','',1,'Comments',3,4,1,1,'article','','','am-facut-upgrade-de-la-cb-500-la-v-strom-1000','','','','','','','','','','','f5f5c4ca8506d67653f323ed4555fbb0','2007-03-16'),(17,'2007-03-19 16:59:00','dragon','2008-08-20 23:55:42','dragon','Concurs enduro-cross','','În data de 17 martie a avut loc în pădurea Făget o cupă privată de enduro-cross organizată de Clubul Transilvania Bikers.\r\nLa rugămintea lui Dan Morar, vice-preşedinte al Clubul Transilvania Bikers, clubul nostru, Seth Riders, a ajutat la arbitraj pe durata cursei.\r\nAşadar, sâmbătă dimineaţa la ora 10.30 ne-am întâlnit membrii clubului in benzinăria OMV de pe Calea Turzii. Acolo am constatat ca am pierdut pe unul dintre noi datoarita chefului cam prelungit de vineri noaptea (abia la ora 17.00 am reuşit să se trezească).\r\nAm plecat apoi spre zona startului, în Faget la Casele Mircesti. Pe drum Robi a avut ceva probleme la Virago, din cauza bateriei f. slabe motorul nu mai vroia să pornească, iar pe drumul de pietriş nu avea destulă aderenţă să pornească împins; aşa că a fost nevoie ca el si Şpo să îl împingă pâna la zona startului (cam 1 km).\r\nDrumul de ţară din Felec până la start nu era tocmai potrivit pentru chopere, dar toţi s-au descurcat excelent.\r\nCursa s-a desfăşutat în două manşe: prima a luat startul clasa C, iar apoi clasele A şi B.\r\nLa clasa C aveam un singur punct de control, acolo am stat împreună. Au mai venit cu noi şi alţi prieteni, eram ca la un fel de picnic. La clasele A şi B ne-am separat in 4 puncte de control. \r\nVremea a fost  excelentă, putin cam mult vânt, dar în rest superb. Profesioniştii au stârnit multora dintr noi interesul de a încerca un motor de cross. Eu cel putin am hotarât de ceva vreme ca urmatorul motor care-l voi achiziţiona va fi unul de hard enduro.\r\nDupă terminarea cursei ne-am reîntors la start unde organizatorii  ne-au recompensat cu un excelent gulaş.\r\nA fost o zi superbă petrecută în aer liber alături de prieteni.','	<p>În data de 17 martie a avut loc în pădurea Făget o cupă privată de enduro-cross organizată de Clubul Transilvania Bikers.<br />\nLa rugămintea lui Dan Morar, vice-preşedinte al Clubul Transilvania Bikers, clubul nostru, Seth Riders, a ajutat la arbitraj pe durata cursei.<br />\nAşadar, sâmbătă dimineaţa la ora 10.30 ne-am întâlnit membrii clubului in benzinăria OMV de pe Calea Turzii. Acolo am constatat ca am pierdut pe unul dintre noi datoarita chefului cam prelungit de vineri noaptea (abia la ora 17.00 am reuşit să se trezească).<br />\nAm plecat apoi spre zona startului, în Faget la Casele Mircesti. Pe drum Robi a avut ceva probleme la Virago, din cauza bateriei f. slabe motorul nu mai vroia să pornească, iar pe drumul de pietriş nu avea destulă aderenţă să pornească împins; aşa că a fost nevoie ca el si Şpo să îl împingă pâna la zona startului (cam 1 km).<br />\nDrumul de ţară din Felec până la start nu era tocmai potrivit pentru chopere, dar toţi s-au descurcat excelent.<br />\nCursa s-a desfăşutat în două manşe: prima a luat startul clasa C, iar apoi clasele A şi B.<br />\nLa clasa C aveam un singur punct de control, acolo am stat împreună. Au mai venit cu noi şi alţi prieteni, eram ca la un fel de picnic. La clasele A şi B ne-am separat in 4 puncte de control. <br />\nVremea a fost  excelentă, putin cam mult vânt, dar în rest superb. Profesioniştii au stârnit multora dintr noi interesul de a încerca un motor de cross. Eu cel putin am hotarât de ceva vreme ca urmatorul motor care-l voi achiziţiona va fi unul de hard enduro.<br />\nDupă terminarea cursei ne-am reîntors la start unde organizatorii  ne-au recompensat cu un excelent gulaş.<br />\nA fost o zi superbă petrecută în aer liber alături de prieteni.</p>\n\n ','În data de 17 martie a avut loc în pădurea Făget o cupă privată de enduro-cross organizată de Clubul Transilvania Bikers.\r\nLa rugămintea lui Dan Morar, vice-preşedinte al Clubul Transilvania Bikers, clubul nostru, Seth Riders, a ajutat la arbitraj pe durata cursei.','	<p>În data de 17 martie a avut loc în pădurea Făget o cupă privată de enduro-cross organizată de Clubul Transilvania Bikers.<br />\nLa rugămintea lui Dan Morar, vice-preşedinte al Clubul Transilvania Bikers, clubul nostru, Seth Riders, a ajutat la arbitraj pe durata cursei.</p>\n\n ','','motoring','motoring',1,'Comments',1,4,1,1,'article','','','concurs-enduro-cross','','','','','','','','','','','ce323f5f7e9828c8bf296050ac2bbcc6','2007-03-19'),(18,'2008-09-02 17:31:00','dragon','2009-01-01 17:50:31','dragon','E timpul sa ne luam la revedere...','','Dupa un an si jumatate impreuna, peste 20.000 de km si multe aventuri este timpul sa-i spun la revedere V-Strom-ului.\r\nV-Strom-ul este un motor de touring extraordinar, perfect pentru drumurile din Romania. Intodeauna a fost ascultator si de un confort incredibil, nu am avut nici un incident in tot acest timp.\r\nCu inima grea m-am hotarat sa-l vand, singura consolare este faptul ca, probabil, o sa-mi iau un frate de al lui nou nascut.\r\nDaca aveti nevoie de un motor stabil, previzibil, controlabil cu care puteti sa faceti 1.000 km pe zi fara sa va tabaciti partea dorsala nu ezitati sa ma contactati.\r\nDatele tehnice: Suzuki V-Strom DL 1000, an fabricatie 2002, 42.000 km, 100 cp, alarma cu pager, crash bar, topcase. Pret: 4400 euro.\r\n\r\n!images/8t.jpg!:images/8.jpg  !images/9t.jpg!:images/9.jpg','	<p>Dupa un an si jumatate impreuna, peste 20.000 de km si multe aventuri este timpul sa-i spun la revedere V-Strom-ului.<br />\nV-Strom-ul este un motor de touring extraordinar, perfect pentru drumurile din Romania. Intodeauna a fost ascultator si de un confort incredibil, nu am avut nici un incident in tot acest timp.<br />\nCu inima grea m-am hotarat sa-l vand, singura consolare este faptul ca, probabil, o sa-mi iau un frate de al lui nou nascut.<br />\nDaca aveti nevoie de un motor stabil, previzibil, controlabil cu care puteti sa faceti 1.000 km pe zi fara sa va tabaciti partea dorsala nu ezitati sa ma contactati.<br />\nDatele tehnice: Suzuki V-Strom DL 1000, an fabricatie 2002, 42.000 km, 100 cp, alarma cu pager, crash bar, topcase. Pret: 4400 euro.</p>\n	<p><a href=\"images/8.jpg\"><img src=\"http://mihai.dragontech.ro/images/8t.jpg\" title=\"\" alt=\"\" /></a>  <a href=\"images/9.jpg\"><img src=\"http://mihai.dragontech.ro/images/9t.jpg\" title=\"\" alt=\"\" /></a></p>\n\n ','Dupa un an si jumatate impreuna, peste 20.000 de km si multe aventuri este timpul sa-i spun la revedere V-Strom-ului.','	<p>Dupa un an si jumatate impreuna, peste 20.000 de km si multe aventuri este timpul sa-i spun la revedere V-Strom-ului.</p>\n\n ','','motoring','motoring',1,'Comments',0,4,1,1,'article','','','e-timpul-sa-ne-luam-la-revedere','','','','','','','','','','','53f8fcc0636ca3d936b8e773f86cbf58','2008-09-02'),(19,'2009-01-01 17:44:00','dragon','2009-01-01 17:49:03','dragon','Ganduri de inceput de an','','Tocmai am pasit intr-un nou an si ma gandeam sa fac o lista cu ce as dori sa realizez in 2009.\r\n\r\nAm citit undeva ca daca iti notezi si faci cunoscute si altor persoane telurile tale, sansele de a se materializa cresc considerabil. \r\n\r\nM-am decis sa testez teoria, sa vedem cam ce as dori sa indeplinesc in acest an:\r\n* sa invat un nou limbaj de programare\r\n* sa-mi imbunatatesc cunostintele de limba engleza\r\n* sa fac turul Alpilor cu motocicleta\r\n* sa particip la o cursa de enduro-cross\r\n\r\nO sa va tin la curent cu evolutia in realizarea lor, pana atunci va doresc un an nou fericit si plin de impliniri.','	<p>Tocmai am pasit intr-un nou an si ma gandeam sa fac o lista cu ce as dori sa realizez in 2009.</p>\n	<p>Am citit undeva ca daca iti notezi si faci cunoscute si altor persoane telurile tale, sansele de a se materializa cresc considerabil. </p>\n	<p>M-am decis sa testez teoria, sa vedem cam ce as dori sa indeplinesc in acest an:\n	<ul>\n		<li>sa invat un nou limbaj de programare</li>\n		<li>sa-mi imbunatatesc cunostintele de limba engleza</li>\n		<li>sa fac turul Alpilor cu motocicleta</li>\n		<li>sa particip la o cursa de enduro-cross</li>\n	</ul></p>\n	<p>O sa va tin la curent cu evolutia in realizarea lor, pana atunci va doresc un an nou fericit si plin de impliniri.</p>\n\n ','Tocmai am pasit intr-un nou an si ma gandeam sa fac o lista cu ce as dori sa realizez in 2009.\r\n\r\nAm citit undeva ca daca iti notezi si faci cunoscute si altor persoane telurile tale, sansele de a se materializa cresc considerabil. ','	<p>Tocmai am pasit intr-un nou an si ma gandeam sa fac o lista cu ce as dori sa realizez in 2009.</p>\n	<p>Am citit undeva ca daca iti notezi si faci cunoscute si altor persoane telurile tale, sansele de a se materializa cresc considerabil. </p>\n\n ','','miscellaneous','',1,'Comments',0,4,1,1,'article','','','ganduri-de-inceput-de-an','','','','','','','','','','','2bf633051a47e8ac8b020fe9062319b3','2009-01-01'),(20,'2009-06-17 22:46:34','mihai','2009-06-17 22:46:34','','Relocare','','Ca urmare a încheierii cu succes a achiziţie domeniului frisan.ro doresc să vă anunţ că începând de astăzi blogul va avea o nouă adresa: \"mihai.frisan.ro\":http://mihai.frisan.ro \r\n\r\nRelocarea nu a fost fără incidente, dar sper că acum totul funcţionează. \r\n\r\nCu promisiunea că o sa încerc să postez mai des, aştept sugestii despre ce anume a-ţi fi interesaţi să citiţi.','	<p>Ca urmare a încheierii c