=\"http://www.wewantappleromania.com/\">www.wewantappleromania.com</a>, găseşti un text în engleză pe care poţi să-l trimiţi la <a href=\"http://www.apple.com/feedback/\">adresele de feedback</a> Apple.</p>\n\n ','','miscellaneous','miscellaneous',1,'Comentarii',0,4,1,1,'article','','','we-want-apple-romania','','','','','','','','','','','8cefd629df121935709682453232f153','2009-07-07'),(22,'2009-12-31 20:09:00','mihai','2009-12-31 20:11:54','mihai','Privind în urmă','','Aproape a mai trecut un an şi probabil este cel mai bun moment pentru o evaluare a ceea ce s-a întâmplat în 2009.\r\n\r\nÎn primul rând mă bucur că sunt sănătos şi că genunchiul drept şi-a revenit complet după fractura de rotulă din noiembrie 2008. De asemenea îmi pare bine că am reuşit să petrec împreuna cu Codri şi câţiva prieteni apropiaţi în ianuarie câteva zile de neuitat la Garmisch-Partenkirchen şi în septembrie un concediu extraordinar în Antalia.\r\n\r\nTot la capitolul realizări trebuie să trec organizarea împreuna cu ceilalţi membrii \"Seth RC\":http://www.sethrc.ro a celei de-a doua ediţii a festivalului pentru motociclişti \"Seth on Fire\":http://www.motociclism.ro/forum/index.php?showtopic=222471&st=60. Aici aş mai putea să reamintesc şi alte acţiuni pe care le-am organizat: \"Campania Motocicliştii există în trafic\":http://www.motociclism.ro/forum/index.php?showtopic=331609, Concurs parcurgere poligon - \"Ediţia I\":http://www.motociclism.ro/forum/index.php?showtopic=360934 şi \"Ediţia II\":http://www.motociclism.ro/forum/index.php?showtopic=421179, precum şi participarea la câteva întruniri de motociclişti şi numeroasele ieşiri de week-end cu motoarele.\r\nTot de zona motociclistică a acestui an cred că ţine şi faptul că am mai achiziţionat o motocicleta, dar despre ea o să va povestesc mai multe în câteva articole ulterioare.\r\n\r\nPe plan profesional cea mai mare realizare este faptul că am început colaborarea cu \"Sparktech\":http://www.sparktechsoft.com, unde am cunoscut oameni extraordinari şi împreună cu care am realizat câteva proiecte interesante.\r\n\r\nAr trebui să menţionez însă şi câteva dintre lucrurile pe care nu l-am realizat în acest an. Cred că cea mai mare dezamăgire pe plan profesional este faptul că nu am reuşit să încheg o echipa aici în Cluj, urmată de nematerializarea nici uneia din ideile de aplicaţii.\r\nDin păcate nici motocicleta enduro pe care mi-o doresc de ceva vreme nu am reuşit încă să o achiziţionez.\r\n\r\nPentru mine anul 2009 a fost un an bun, în care realizările au depăşit de departe dezamăgirile. Sper că 2010 să aducă cel puţin la fel de multe satisfacţii.\r\n','	<p>Aproape a mai trecut un an şi probabil este cel mai bun moment pentru o evaluare a ceea ce s-a întâmplat în 2009.</p>\n	<p>În primul rând mă bucur că sunt sănătos şi că genunchiul drept şi-a revenit complet după fractura de rotulă din noiembrie 2008. De asemenea îmi pare bine că am reuşit să petrec împreuna cu Codri şi câţiva prieteni apropiaţi în ianuarie câteva zile de neuitat la Garmisch-Partenkirchen şi în septembrie un concediu extraordinar în Antalia.</p>\n	<p>Tot la capitolul realizări trebuie să trec organizarea împreuna cu ceilalţi membrii <a href=\"http://www.sethrc.ro\">Seth RC</a> a celei de-a doua ediţii a festivalului pentru motociclişti <a href=\"http://www.motociclism.ro/forum/index.php?showtopic=222471&#38;st=60\">Seth on Fire</a>. Aici aş mai putea să reamintesc şi alte acţiuni pe care le-am organizat: <a href=\"http://www.motociclism.ro/forum/index.php?showtopic=331609\">Campania Motocicliştii există în trafic</a>, Concurs parcurgere poligon &#8211; <a href=\"http://www.motociclism.ro/forum/index.php?showtopic=360934\">Ediţia I</a> şi <a href=\"http://www.motociclism.ro/forum/index.php?showtopic=421179\">Ediţia II</a>, precum şi participarea la câteva întruniri de motociclişti şi numeroasele ieşiri de week-end cu motoarele.<br />\nTot de zona motociclistică a acestui an cred că ţine şi faptul că am mai achiziţionat o motocicleta, dar despre ea o să va povestesc mai multe în câteva articole ulterioare.</p>\n	<p>Pe plan profesional cea mai mare realizare este faptul că am început colaborarea cu <a href=\"http://www.sparktechsoft.com\">Sparktech</a>, unde am cunoscut oameni extraordinari şi împreună cu care am realizat câteva proiecte interesante.</p>\n	<p>Ar trebui să menţionez însă şi câteva dintre lucrurile pe care nu l-am realizat în acest an. Cred că cea mai mare dezamăgire pe plan profesional este faptul că nu am reuşit să încheg o echipa aici în Cluj, urmată de nematerializarea nici uneia din ideile de aplicaţii.<br />\nDin păcate nici motocicleta enduro pe care mi-o doresc de ceva vreme nu am reuşit încă să o achiziţionez.</p>\n	<p>Pentru mine anul 2009 a fost un an bun, în care realizările au depăşit de departe dezamăgirile. Sper că 2010 să aducă cel puţin la fel de multe satisfacţii.</p>\n\n\n ','Aproape a mai trecut un an şi probabil este cel mai bun moment pentru o evaluare a ceea ce s-a întâmplat în 2009.\r\n\r\nÎn primul rând mă bucur că sunt sănătos şi că genunchiul drept şi-a revenit complet după fractura de rotula din noiembrie 2008. De asemenea îmi pare bine că am reuşit să petrec împreuna cu Codri şi câţiva prieteni apropiaţi în ianuarie câteva zile de neuitat la Garmisch-Partenkirchen şi în septembrie un concediu extraordinar în Antalia.','	<p>Aproape a mai trecut un an şi probabil este cel mai bun moment pentru o evaluare a ceea ce s-a întâmplat în 2009.</p>\n	<p>În primul rând mă bucur că sunt sănătos şi că genunchiul drept şi-a revenit complet după fractura de rotula din noiembrie 2008. De asemenea îmi pare bine că am reuşit să petrec împreuna cu Codri şi câţiva prieteni apropiaţi în ianuarie câteva zile de neuitat la Garmisch-Partenkirchen şi în septembrie un concediu extraordinar în Antalia.</p>\n\n ','','miscellaneous','miscellaneous',1,'Comentarii',0,4,1,1,'article','','','privind-in-urma','','','','','','','','','','','7a7ac95c6288961f35fa702990b4fffe','2009-12-31'),(23,'2010-04-13 20:30:00','mihai','2010-04-14 16:33:36','mihai','Motocicliştii teribilişti contra automobiliştilor inconştienţi','','Astăzi am fost intervievat de \"Bogdan Buburuz\":http://buburuz.wordpress.com/ de la \"CityNews\":http://www.citynews.ro în legătură cu problemele care apar în trafic odată cu încălzirea vremii şi apariţia pe şosele a tot mai multor motociclişti (puteţi vedea articolul \"aici\":http://www.citynews.ro/cluj/din-oras-10/primavara-scoate-motoarele-in-oras-atentie-soferi-78559)\r\n\r\nÎn comentariile articolului s-a stîrnit o polemică legată de cei care poarta partea de vină mai mare, motocicliştii teribilişti sau automobiliştii inconştienţi.\r\n\r\nVreau doar să precizez că scopul acţiunilor de prevenire a accidentelor pe care le derulăm este să reducă numărul acestora, nu să arunce vina asupra cuiva. Conducători care nu respectă regulile sunt şi de-o parte şi de alta.  Clubul \"Seth RC\":http://www.sethrc.ro organizează campanii de conştientizare asupra riscurilor de producere a accidentelor adresate atât automobiliştilor cât şi motocicliştilor, iar scopul final este micşorarea numărului de accidente rutiere.','	<p>Astăzi am fost intervievat de <a href=\"http://buburuz.wordpress.com/\">Bogdan Buburuz</a> de la <a href=\"http://www.citynews.ro\">CityNews</a> în legătură cu problemele care apar în trafic odată cu încălzirea vremii şi apariţia pe şosele a tot mai multor motociclişti (puteţi vedea articolul <a href=\"http://www.citynews.ro/cluj/din-oras-10/primavara-scoate-motoarele-in-oras-atentie-soferi-78559\">aici</a>)</p>\n	<p>În comentariile articolului s-a stîrnit o polemică legată de cei care poarta partea de vină mai mare, motocicliştii teribilişti sau automobiliştii inconştienţi.</p>\n	<p>Vreau doar să precizez că scopul acţiunilor de prevenire a accidentelor pe care le derulăm este să reducă numărul acestora, nu să arunce vina asupra cuiva. Conducători care nu respectă regulile sunt şi de-o parte şi de alta.  Clubul <a href=\"http://www.sethrc.ro\">Seth RC</a> organizează campanii de conştientizare asupra riscurilor de producere a accidentelor adresate atât automobiliştilor cât şi motocicliştilor, iar scopul final este micşorarea numărului de accidente rutiere.</p>\n\n ','Astăzi am fost intervievat de \"Bogdan Buburuz\":http://buburuz.wordpress.com/ de la \"CityNews\":http://www.citynews.ro în legătură cu problemele care apar în trafic odată cu încălzirea vremii şi apariţia pe şosele a tot mai multor motociclişti (puteţi vedea articolul \"aici\":http://www.citynews.ro/cluj/din-oras-10/primavara-scoate-motoarele-in-oras-atentie-soferi-78559)','	<p>Astăzi am fost intervievat de <a href=\"http://buburuz.wordpress.com/\">Bogdan Buburuz</a> de la <a href=\"http://www.citynews.ro\">CityNews</a> în legătură cu problemele care apar în trafic odată cu încălzirea vremii şi apariţia pe şosele a tot mai multor motociclişti (puteţi vedea articolul <a href=\"http://www.citynews.ro/cluj/din-oras-10/primavara-scoate-motoarele-in-oras-atentie-soferi-78559\">aici</a>)</p>\n\n ','','motoring','motoring',1,'Comentarii',0,4,1,1,'article','','','motociclitii-teribiliti-contra-automobilitilor-incontieni','','','','','','','','','','','dead84dd528babc1450382c36aa379fe','2010-04-14'),(25,'2010-10-27 15:37:00','mihai','2010-10-27 16:10:44','mihai','How to Web 2010','','Cu câteva săptămâni în urmă am întâlnit un om extraordinar, care împreună cu echipa pe care o conduce face lucruri extraordinare.\r\n\r\n*Cine este omul?* \r\n\"Bogdan Iordache\":http://www.bogdaniordache.net/ - antreprenor, probabil unul din oamenii care reflecta cel mai bine acest cuvânt.\r\n\r\n*Cine este echipa?* \r\n\"Wembrio\":http://www.wembrio.com/.\r\n\r\n*Care sunt lucrurile extraordinare care le fac?* \r\nPrea multe ca să le menţionez într-un singur post. \r\nO să vă spun doar despre \"How to Web\":http://www.how-to-web.net/ - cel mai mare eveniment de antreprenoriat și tehnologie web din Europa de Est. \r\n\r\n*Ce își propune această conferință?* \r\nScopul declarat este să conecteze industria web din Europa de Est și, în particular, din Romania la industria Internet globala. Un scop foarte ambițios e adevărat, dar unul pe care cred că această echipa îl poate realiza.\r\n\r\n*Despre ce se va vorbi la conferință?* \r\nSe vor aborda teme legate de începuturile unei afaceri, finanțarea acesteia, antreprenoriatul în Europa de est și tendințe de dezvoltare, cloud computing, servicii web etc.\r\n\r\n*Cine va vorbi la conferință?*\r\nAmintesc doar câteva nume sonore: Loic Le Meur (CEO Seesmic și Fondator Le Web), Ramu Yalamanchi (CEO Hi5), Reshma Sohoni (CEO Seedcamp), Mike Butcher (redactor-sef TechCrunch Europe), Christopher Grew (Orrick), Alex Van Someren (UKTI), Katy Turner (Eden Ventures) și Alex Hoye (CEO Latitude).\r\n\r\n*De ce aș participa?* \r\nDupa parerea mea câteva din motivele pentru care nu ar trebui să lipsiți de la această conferință ar fii: \r\n* să aflați care sunt trendurile globale în piața aplicațiilor web\r\n* să învățați cum puțeti să vă finanțați afacerea\r\n* să întâlniți potențiali clienți, parteneri sau investitori\r\n* să interacționați cu speakeri de clasă mondială\r\n</ul>*Cât costă?*\r\nPrețul este 201 EURO + TVA\r\n\r\n*Când are loc?*\r\nConferința are loc în 3 și 4 noiembrie 2010 la Hotel Intercontinental în Bucuresti.\r\n\r\nCred că este un eveniment care nu trebuie ratat de oricine are legatură cu piața online, așa că nu așteptați și luați-vă un bilet cât mai repede!\r\n\r\n<object width=\"480\" height=\"290\"><param name=\"movie\" value=\"http://www.youtube.com/v/QbhzWcxJQfQ?fs=1&amp;hl=en_US\"></param><param name=\"allowFullScreen\" value=\"true\"></param><param name=\"allowscriptaccess\" value=\"always\"></param><embed src=\"http://www.youtube.com/v/QbhzWcxJQfQ?fs=1&amp;hl=en_US\" type=\"application/x-shockwave-flash\" allowscriptaccess=\"always\" allowfullscreen=\"true\" width=\"480\" height=\"290\"></embed></object>','	<p>Cu câteva săptămâni în urmă am întâlnit un om extraordinar, care împreună cu echipa pe care o conduce face lucruri extraordinare.</p>\n	<p><strong>Cine este omul?</strong> <br />\n<a href=\"http://www.bogdaniordache.net/\">Bogdan Iordache</a> &#8211; antreprenor, probabil unul din oamenii care reflecta cel mai bine acest cuvânt.</p>\n	<p><strong>Cine este echipa?</strong> <br />\n<a href=\"http://www.wembrio.com/\">Wembrio</a>.</p>\n	<p><strong>Care sunt lucrurile extraordinare care le fac?</strong> <br />\nPrea multe ca să le menţionez într-un singur post. <br />\nO să vă spun doar despre <a href=\"http://www.how-to-web.net/\">How to Web</a> &#8211; cel mai mare eveniment de antreprenoriat și tehnologie web din Europa de Est. </p>\n	<p><strong>Ce își propune această conferință?</strong> <br />\nScopul declarat este să conecteze industria web din Europa de Est și, în particular, din Romania la industria Internet globala. Un scop foarte ambițios e adevărat, dar unul pe care cred că această echipa îl poate realiza.</p>\n	<p><strong>Despre ce se va vorbi la conferință?</strong> <br />\nSe vor aborda teme legate de începuturile unei afaceri, finanțarea acesteia, antreprenoriatul în Europa de est și tendințe de dezvoltare, cloud computing, servicii web etc.</p>\n	<p><strong>Cine va vorbi la conferință?</strong><br />\nAmintesc doar câteva nume sonore: Loic Le Meur (CEO Seesmic și Fondator Le Web), Ramu Yalamanchi (CEO Hi5), Reshma Sohoni (CEO Seedcamp), Mike Butcher (redactor-sef TechCrunch Europe), Christopher Grew (Orrick), Alex Van Someren (UKTI), Katy Turner (Eden Ventures) și Alex Hoye (CEO Latitude).</p>\n	<p><strong>De ce aș participa?</strong> <br />\nDupa parerea mea câteva din motivele pentru care nu ar trebui să lipsiți de la această conferință ar fii: \n	<ul>\n		<li>să aflați care sunt trendurile globale în piața aplicațiilor web</li>\n		<li>să învățați cum puțeti să vă finanțați afacerea</li>\n		<li>să întâlniți potențiali clienți, parteneri sau investitori\n		<li>să interacționați cu speakeri de clasă mondială<br />\n</ul><strong>Cât costă?</strong><br />\nPrețul este 201 EURO + TVA</p>\n	<p><strong>Când are loc?</strong><br />\nConferința are loc în 3 și 4 noiembrie 2010 la Hotel Intercontinental în Bucuresti.</p>\n	<p>Cred că este un eveniment care nu trebuie ratat de oricine are legatură cu piața online, așa că nu așteptați și luați-vă un bilet cât mai repede!</p>\n	<p><object width=\"480\" height=\"290\"><param name=\"movie\" value=\"http://www.youtube.com/v/QbhzWcxJQfQ?fs=1&hl=en_US\"></param><param name=\"allowFullScreen\" value=\"true\"></param><param name=\"allowscriptaccess\" value=\"always\"></param><embed src=\"http://www.youtube.com/v/QbhzWcxJQfQ?fs=1&hl=en_US\" type=\"application/x-shockwave-flash\" allowscriptaccess=\"always\" allowfullscreen=\"true\" width=\"480\" height=\"290\"></embed></object></p>\n\n ','Cu câteva săptămâni în urmă am întâlnit un om extraordinar, care împreună cu echipa pe care o conduce face lucruri extraordinare.\r\n\r\nCine este omul? \r\n\"Bogdan Iordache\":http://www.bogdaniordache.net/ - antreprenor, probabil unul din oamenii care reflecta cel mai bine acest cuvânt.\r\n\r\nCine este echipa? \r\n\"Wembrio\":http://www.wembrio.com/.\r\n\r\nCare sunt lucrurile extraordinare care le fac? \r\nPrea multe ca să le menţionez într-un singur post.\r\nO să vă spun doar despre \"How to Web\":http://www.how-to-web.net/ - cel mai mare eveniment de antreprenoriat și tehnologie web din Europa de Est. ','	<p>Cu câteva săptămâni în urmă am întâlnit un om extraordinar, care împreună cu echipa pe care o conduce face lucruri extraordinare.</p>\n	<p>Cine este omul? <br />\n<a href=\"http://www.bogdaniordache.net/\">Bogdan Iordache</a> &#8211; antreprenor, probabil unul din oamenii care reflecta cel mai bine acest cuvânt.</p>\n	<p>Cine este echipa? <br />\n<a href=\"http://www.wembrio.com/\">Wembrio</a>.</p>\n	<p>Care sunt lucrurile extraordinare care le fac? <br />\nPrea multe ca să le menţionez într-un singur post.<br />\nO să vă spun doar despre <a href=\"http://www.how-to-web.net/\">How to Web</a> &#8211; cel mai mare eveniment de antreprenoriat și tehnologie web din Europa de Est. </p>\n\n ','','miscellaneous','miscellaneous',1,'Comentarii',0,4,1,1,'article','','','how-to-web-2010','','','','','','','','','','','97cde5fdbfc306700479751b09758fc6','2010-10-27');
