INSERT INTO `txp_discuss` (`discussid`, `parentid`, `name`, `email`, `web`, `ip`, `posted`, `message`, `visible`) VALUES (000007,4,'adi','axra2000@yahoo.it','','81.196.150.111','2006-02-28 09:32:57','<p>Salutare, am si eu o intrebare. Unde este barul Fox?</p>',1),(000008,4,'Mihai Frişan','mihai.frisan@dragontech.ro','','83.103.131.230','2006-02-28 09:41:52','<p>Str. Teleorman, nr. 25</p>',1),(000009,17,'diana','pridon_diana@yahoo.com','funnydidi.hi5.com','86.107.116.77','2007-10-23 19:42:14','<p>cred ca a fost frumoas &#8230;.deoarece nu stiu pt ca nu am fost la acest concurs</p>',1),(000010,16,'Gez','geza@dvis.info','groller.info/geza','82.208.131.174','2007-12-08 23:17:27','<p>Felicitari pt noua achizitie. </p>\n\n	<p>Cat a costat motorul si cat a costat transportul?</p>',1),(000011,16,'Mihai Frisan','mihaifrisan@gmail.com','mihai.dragontech.ro','85.186.3.106','2007-12-09 23:46:26','<p>Multumesc. <br />Ti-am raspuns pe mail.</p>',1),(000012,16,'Elod','gy_elod@yahoo.com','ww.youtube.com/watch?v=1BHvXD0wBq0','80.97.66.192','2008-04-03 09:25:32','<p>felicitari, uite noi ieri am descarcat un DL 1000 in Bistrita, al unui prieten, eu personal am un XF650, si ma gandesc ca la anul sa-mi iau si un SV650S sau SV1000S. ne-am si dat putintel pe V-Strom, ii beton! trage bivolul ca drak, are forta, acceleratie, tot ce vrei, si intr-adevar, e stabila de nota 10, iar cele 240 kg nici nu se simt. schimbatorul de viteze e silentios, aproape nici nu-l simti…</p>',1),(000013,15,'Dark','darkmanns_realm@yahoo.com','','87.237.110.38','2008-06-20 17:35:00','<p>Omule ma bucur k ai intrat si tu in clubul cataratorilor.E cea mai tare senzatie cand esti pe stanca deasupra tuturor.Senzatia aia de calm si entuziasmul primei catarari nu ai sa o uiti niciodata.<br />Sper ca te vei tine in continuare de acest sport pentru ca nu se compara cu nici altul.<br />Multa bafta in viitor, si tot mai multe ture la activ.</p>',1),(000015,18,'wawjvoijc','pwyowq@zontdl.com','http://wtfgqtnygnug.com/','89.24