INSERT INTO `txp_form` (`name`, `type`, `Form`) VALUES ('Links','link','<p><txp:link /><br />\r\n<txp:link_description /></p>'),('plainlinks','link','<li><txp:linkdesctitle /></li>'),('comments','comment','	<ol class=\"commentlist\">\r\n               <li class=\"<txp:ajw_comment_alt even=\"alt\" odd=\"\" />\">\r\n	<div class=\"comment_author\"><txp:comment_name /></div>\r\n<p class=\"metadate\"><txp:comment_permlink>\r\n    <txp:php>\r\n    global $locale;\r\n    setlocale(LC_ALL, \'en_EN.UTF-8\');\r\n    echo comment_time(array(\'format\' => \'%B %e, %Y, %H:%M\'));\r\n    setlocale(LC_ALL, $locale);\r\n    </txp:php>\r\n</txp:comment_permlink></p>\r\n<p><txp:message /></p>\r\n\r\n<br />\r\n\r\n              </li>\r\n         </ol>'),('default','article','<h2><txp:permlink><txp:title /></txp:permlink></h2>\r\n<div class=\"meta\">\r\n    <txp:php>\r\n    global $locale;\r\n    setlocale(LC_ALL, \'en_EN.UTF-8\');\r\n    echo posted(array(\'format\' => \'%B %e, %Y, %H:%M\'));\r\n    setlocale(LC_ALL, $locale);\r\n    </txp:php>\r\n</div>\r\n	<div class=\"main\">\r\n		<txp:body />\r\n	</div>\r\n	<div class=\"comments\"><txp:comments_invite /></div>'),('comment_form','comment','<div class=\"comment_title\">What do you think?</div>\r\n<table cellpadding=\"4\" cellspacing=\"0\" border=\"0\">	\r\n    <tr>	  \r\n        <td align=\"right\" valign=\"top\"><label for=\"name\"><txp:text item=\"name\" /></label></td>\r\n        <td valign=\"top\"><txp:comment_name_input /></td>\r\n        <td valign=\"top\" align=\"left\"><txp:comment_remember /></td>\r\n    </tr>\r\n    <tr>\r\n        <td align=\"right\" valign=\"top\"><label for=\"email\"><txp:text item=\"e-mail\" /></label></td>\r\n        <td valign=\"top\" colspan=\"2\"><txp:comment_email_input /></td> \r\n    </tr>\r\n    <tr> \r\n        <td align=\"right\" valign=\"top\"><label for=\"web\"><txp:text item=\"http://\" /></label></td>\r\n        <td valign=\"top\" colspan=\"2\"><txp:comment_web_input /></td>\r\n    </tr>\