INSERT INTO `txp_page` (`name`, `user_html`) VALUES ('default','<txp:output_form form=\"Temp_header\" />\r\n\r\n<txp:output_form form=\"Temp_sidebar\" />\r\n\r\n<div id=\"content\">\r\n\r\n	<txp:article form=\"default\" listform=\"excerpt\" />\r\n	<txp:if_individual_article>\r\n	<p>\r\n	<txp:link_to_prev><txp:prev_title /></txp:link_to_prev>\r\n	<txp:link_to_next><txp:next_title /></txp:link_to_next>\r\n	</p>\r\n	</txp:if_individual_article>\r\n	<txp:if_article_list>\r\n	<p>\r\n	<txp:older>Previous</txp:older>\r\n	<txp:newer>Next</txp:newer>\r\n	</p>\r\n	</txp:if_article_list>\r\n\r\n</div>\r\n<!-- End content -->\r\n\r\n<txp:output_form form=\"Temp_footer\" />\r\n\r\n</div>\r\n<script src=\"http://www.google-analytics.com/urchin.js\" type=\"text/javascript\">\r\n</script>\r\n<script type=\"text/javascript\">\r\n_uacct = \"UA-3191319-1\";\r\nurchinTracker();\r\n</script>\r\n<script type=\"text/javascript\" src=\"http://twitter.com/javascripts/blogger.js\"></script>\r\n<script type=\"text/javascript\" src=\"http://twitter.com/statuses/user_timeline/mihaifrisan.json?callback=twitterCallback2&amp;count=5\"></script>\r\n</body></html>'),('archive_list','<txp:output_form form=\"Temp_header\" />\r\n\r\n<txp:output_form form=\"Temp_sidebar\" />\r\n\r\n<div id=\"content\">\r\n\r\n	<txp:article_custom limit=99999 form=\"monthly_article\" />\r\n	<txp:if_individual_article>\r\n	<p>\r\n	<txp:link_to_prev><txp:prev_title /></txp:link_to_prev>\r\n	<txp:link_to_next><txp:next_title /></txp:link_to_next>\r\n	</p>\r\n	</txp:if_individual_article>\r\n	<txp:if_article_list>\r\n	<p>\r\n	<txp:older>Previous</txp:older>\r\n	<txp:newer>Next</txp:newer>\r\n	</p>\r\n	</txp:if_article_list>\r\n\r\n</div>\r\n<!-- End content -->\r\n\r\n<txp:output_form form=\"Temp_footer\" />\r\n\r\n</div>\r\n<script src=\"http://www.google-analytics.com/urchin.js\" type=\"text/javascript\">\r\n</script>\r\n<script type=\"text/javascript\">\r\n_uacct = \"UA-3191319-1\";\r\nurchinTracker();\r\n</script>\r\n<script type=\"text/javascript\" src=\"http://twitter.com/javascripts/blogger.js\"></script>\r\n<script type=\"text/javascript\" src=\"http://twitter.com/statuses/user_timeline/mihaifrisan.json?callback=twitterCallback2&amp;count=5\"></script>\r\n</body></html>'),('about','<txp:output_form form=\"Temp_header\" />\r\n\r\n<txp:output_form form=\"Temp_sidebar\" />\r\n\r\n<div id=\"content\">\r\n<txp:article form=\"about\" listform=\"about\" />\r\n</div>\r\n<!-- End content -->\r\n\r\n<txp:output_form form=\"Temp_footer\" />\r\n\r\n</div>\r\n<script src=\"http://www.google-analytics.com/urchin.js\" type=\"text/javascript\">\r\n</script>\r\n<script type=\"text/javascript\">\r\n_uacct = \"UA-3191319-1\";\r\nurchinTracker();\r\n</script>\r\n<script type=\"text/javascript\" src=\"http://twitter.com/javascripts/blogger.js\"></script>\r\n<script type=\"text/javascript\" src=\"http://twitter.com/statuses/user_timeline/mihaifrisan.json?callback=twitterCallback2&amp;count=5\"></script>\r\n</body></html>');
