INSERT INTO `txp_plugin` (`name`, `status`, `author`, `author_uri`, `version`, `description`, `help`, `code`, `code_restore`, `code_md5`, `type`) VALUES ('rss_live_search',1,'Rob Sable','http://www.wilshireone.com/','0.2.2','Live search.','\n	<h1>Textpattern Live Search</h1>\n\n	<p>This plugin is based on work done by:</p>\n\n	<ul>\n	<li>Markus Kniebes&#8217; <a href=\"http://kniebes.net/docs/textpattern/livesearch\">LiveSearch Extension for Textpattern</a></li>\n		<li><a href=\"http://blog4.bitflux.ch/wiki/LiveSearch\">BitFlux LiveSearch Solution</a></li>\n	</ul>\n\n	<h2>How to Use This Plugin</h2>\n\n	<ol>\n	<li>Install and activate the plugin of course.</li>\n		<li>Add a call to <code>&lt;txp:rss_live_search_js /&gt;</code> in the <code>&lt;head&gt;</code> section of your page.</li>\n		<li>Add a call to <code>&lt;txp:rss_live_search /&gt;</code> wherever you want the search form to appear.  Add any of the optional attributes below.</li>\n		<li>Include the <a href=\"#searchstyle\">styles below</a> in your stylesheet.  Feel free to modify the styles as you see fit.</li>\n	</ol>\n\n	<h2>Attributes</h2>\n\n	<p><strong>max</strong><br />\nThe maximum number of live search results returned.<br />\nDefault:  &#8220;20&#8221;<br />\nExample: max=&#8221;10&#8221;</p>\n\n	<p><strong>label</strong><br />\nThe label that appears next to the search input.<br />\nDefault:  &#8220;LiveSearch: &#8221;<br />\nExample: label=&#8221;Type To Search: &#8221;</p>\n\n	<p><strong>inputvalue</strong><br />\nThe text that appears in the search input field by default.<br />\nDefault:  &#8220;&#8221;<br />\nExample: inputvalue=&#8221;search the archives&#8221;</p>\n\n	<p><strong>inputsize</strong><br />\nThe size of the search input field.<br />\nDefault:  &#8220;20&#8221;<br />\nExample: inputsize=&#8221;30&#8221;</p>\n\n	<p><strong>showbutton</strong><br />\nDetermines whether a submit button appears on the live search form.<br />\nDefault:  &#8220;0&#8221;<br />\nExample: showbutton=&#8221;1&#8221;</p>\n\n	<p><strong>buttonval</strong><br />\nThe text that appears on the search form submit button.<br />\nDefault:  &#8220;Submit&#8221;<br />\nExample: buttonval=&#8221;Go!&#8221;</p>\n\n	<p><strong>searchto</strong><br />\nBy default the search form action will be your site home URL.  If you want to post your form to a subdirectory, indicate so here.  In the example below, the search would be posted to http://yoursite.com/search/?q=search+terms<br />\nDefault:  &#8220;&#8221;<br />\nExample: searchto=&#8221;search&#8221;</p>\n\n	<p><strong>autocompleteoff</strong><br />\nAdds autocmplete=&#8221;off&#8221; to the search input field.  <strong>NOTE:</strong> This will not validate against the XHTML spec.<br />\nDefault:  &#8220;0&#8221;<br />\nExample: autocompleteoff=&#8221;1&#8221;</p>\n\n	<p><strong>form</strong><br />\nThe article form used to display search results.  Each search result will be rendered using the form and place inside a div as below.<br />\n<code>&lt;div class=\"LSRow\"&gt;</code>FORM CONTENT<code>&lt;/div&gt;</code><br />\nDefault:  &#8220;&#8221;<br />\nExample: form=&#8221;live_search_article&#8221;</p>\n\n	<p><strong>showdate</strong><br />\nThe article post date will be displayed in a span following the article title.<br />\nDefault:  &#8220;0&#8221;<br />\nExample: showdate=&#8221;1&#8221;</p>\n\n	<p><strong>excerpts</strong><br />\nDetermines whether search results excerpts below article titles as on a normal Textpattern search.<br />\nDefault:  &#8220;0&#8221;<br />\nExample: excerpts=&#8221;1&#8221;</p>\n\n	<p><strong>notfound</strong><br />\nThe message displayed when no search results are found.<br />\nDefault:  &#8220;No Results Found.&#8221;<br />\nExample: notfound=&#8221;Nothing to see here.&#8221;</p>\n\n	<h2 id=\"searchstyle\">Example Styles</h2>\n\n<code>\n	<p>#LSResult  { position: absolute; background-color: #fff; width: 350px; }</p>\n	<p>#LSShadow { padding: 5px; }</p>\n	<p>#LSRes { background-color: #fff; }<br />\n.LSRow { padding: 0 5px; }</p>\n	<p>#LSHighlight  { background-color: #aaa; }</p>\n	<p>#LSHeader { padding: 2px 2px 8px; }<br />\n.lsDate { display: block; color: #555; }<br />\n</code></p>\n\n\n\n ','/*\r\nrss_live_search plugin for Textpattern\r\n    <URL: http://www.wilshireone.com/textpattern-plugins/rss-live-search>\r\nbased on LiveSearch Extension for Textpattern, Markus Kniebes\r\n		<URL: mailto:mk@kniebes.net>\r\nbased on BitFlux LiveSearch Solution\r\n		<URL: http://blog4.bitflux.ch/wiki/LiveSearch>\r\n*/\r\n\r\nfunction rss_live_search_js() {\r\n	return \'<script type=\"text/javascript\" src=\"\'.hu.\'?file=livesearch\"></script>\';\r\n}\r\n\r\nfunction rss_live_search($atts) {\r\n\r\n  extract(lAtts(array(\r\n    \'max\'        => 20,\r\n    \'excerpts\' => \'0\',\r\n    \'label\' => \'Live search: \',\r\n    \'notfound\' => \'Not found.\',\r\n    \'searchto\' => \'\',\r\n    \'autocompleteoff\' => \'0\',\r\n    \'showdate\' => \'0\',\r\n    \'form\' => \'\',\r\n    \'inputvalue\' => \'\',\r\n    \'inputsize\' => \'20\',\r\n    \'showbutton\' => \'0\',\r\n    \'buttonval\' => \'Search\'\r\n  ),$atts));\r\n\r\nif (gps(\'ls\') != \"\") {\r\n    function livesearch( $q, $max, $doExc, $notfound, $showdate, $form) {\r\n        global $prefs;\r\n        extract($prefs);\r\n\r\n				$s_filter = \"\";\r\n				$rs = safe_column(\"name\", \"txp_section\", \"searchable != \'1\'\");\r\n				if ($rs) {\r\n					foreach($rs as $name) $filters[] = \"and Section != \'$name\'\";\r\n					$s_filter =  join(\' \',$filters);\r\n				}\r\n\r\n        ob_start();\r\n        header( \"Content-Type: text/xml\" );\r\n        print \'<?xml version=\\\'1.0\\\' encoding=\\\'utf-8\\\'  ?>\';\r\n\r\n				$where = \"(Title rlike \'$q\' or Body rlike \'$q\') $s_filter and Status = 4 and Posted <=now() order by score desc limit $max\";\r\n        $rs = safe_rows(\r\n            \"*, ID as thisid, unix_timestamp(Posted) as posted, Title as title, match (Title,Body) against (\'$q\') as score\",\r\n            \"textpattern\", $where);\r\n\r\n				if ($form) {\r\n					if ($rs) {\r\n            $o = array();\r\n            $o[] = \'<div id=\"LSRes\">\';\r\n						foreach($rs as $a) {\r\n							extract($a);\r\n							populateArticleData($a);\r\n							$article = fetch(\'Form\', \'txp_form\', \'name\', $form);\r\n							$o[] = \'<div class=\"LSRow\">\'.parse($article).\'</div>\';\r\n							unset($GLOBALS[\'thisarticle\']);\r\n						}\r\n						$o[] = \'</div>\';\r\n					} else {\r\n        	$o[] = $notfound;\r\n        	}\r\n					print (is_array($o)) ? implode( \"\", $o ) : \'\';\r\n   				exit;\r\n				}\r\n\r\n        if( $rs ) {\r\n            $o = array();\r\n            $o[] = \'<div id=\"LSRes\">\';\r\n            foreach($rs as $a) {\r\n                extract($a);\r\n								populateArticleData($a);\r\n								$hurl = permlinkurl($a);\r\n\r\n                if( $doExc ) {\r\n                    $result = preg_replace(\"/>\\s*</\",\"> <\",$Body_html);\r\n                    preg_match_all(\"/\\s.{0,50}\".$q.\".{0,50}\\s/i\",$result,$concat);\r\n                    $concat = implode(\" ... \",$concat[0]);\r\n                    $concat = strip_tags($concat);\r\n                    $concat = preg_replace(\'/^[^>]+>/U\',\"\",$concat);\r\n                    $concat = preg_replace(\"/($q)/i\",\"<strong>$1</strong>\",$concat);\r\n                    $result_excerpt = ($concat) ? \"... \".$concat.\" ...\" : \'\';\r\n                    $Title = \'<strong>\'.$Title.\'</strong>\';\r\n                }\r\n								$sd = ($showdate) ? \'<span class=\"lsDate\">\'.strftime($archive_dateformat,$uPosted).\'</span>\' : \'\';\r\n                $o[] = \'<div class=\"LSRow\"><a href=\"\'.$hurl.\'\">\'.$Title.\'</a>\'.$sd.\'</div>\';\r\n                if( $doExc ) {\r\n                    $o[] = \'<br />\';\r\n                    $o[] = $result_excerpt;\r\n                }\r\n            }\r\n            $o[] = \'</div>\';\r\n        } else {\r\n        	$o[] = $notfound;\r\n        }\r\n        print (is_array($o)) ? implode( \"\", $o ) : \'\';\r\n    }\r\n\r\n	exit(livesearch(gps(\'ls\'), $max, $excerpts, $notfound, $showdate, $form));\r\n}\r\n\r\n$ac = ($autocompleteoff) ? \'autocomplete=\"off\" \' : \'\';\r\n\r\nif ($inputvalue != \"\") {\r\n	$input = \'\r\n	<input id=\"livesearch\" name=\"q\" value=\"\'.$inputvalue.\'\" onkeypress=\"liveSearchStart()\"\r\n	size=\"\'.$inputsize.\'\" onblur=\"if (this.value == \\\'\\\') {this.value = \\\'\'.$inputvalue.\'\\\';}\"\r\n	onfocus=\"if (this.value == \\\'\'.$inputvalue.\'\\\') {this.value = \\\'\\\';}\" \'.$ac.\' />\';\r\n} else {\r\n	$input = \'<input id=\"livesearch\" name=\"q\" onkeypress=\"liveSearchStart()\" size=\"\'.$inputsize.\'\" \'.$ac.\' />\';\r\n}\r\n\r\n$sbtn = ($showbutton) ? \'<input type=\"submit\" id=\"livesearchsubmit\" value=\"\'.$buttonval.\'\" />\' : \'\';\r\n\r\nreturn \'<form id=\"searchform\" name=\"searchform\" method=\"get\" action=\"\'.hu.$searchto.\'\" onsubmit=\"return liveSearchSubmit()\">\r\n				<label>\'.$label.$input.\'</label>\'.$sbtn.\'<br/>\r\n				<div id=\"LSResult\" style=\"display: none;\"><div id=\"LSShadow\"></div></div>\r\n			</form>\';\r\n}\r\n\r\nif (gps(\'file\') == \'livesearch\') {\r\nglobal $pfr;\r\necho <<<EOF\r\n/*\r\n// +----------------------------------------------------------------------+\r\n// | Copyright (c) 2004 Bitflux GmbH                                      |\r\n// +----------------------------------------------------------------------+\r\n// | Licensed under the Apache License, Version 2.0 (the \"License\");      |\r\n// | you may not use this file except in compliance with the License.     |\r\n// | You may obtain a copy of the License at                              |\r\n// | http://www.apache.org/licenses/LICENSE-2.0                           |\r\n// | Unless required by applicable law or agreed to in writing, software  |\r\n// | distributed under the License is distributed on an \"AS IS\" BASIS,    |\r\n// | WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or      |\r\n// | implied. See the License for the specific language governing         |\r\n// | permissions and limitations under the License.                       |\r\n// +----------------------------------------------------------------------+\r\n// | Author: Bitflux GmbH <devel@bitflux.ch>                              |\r\n// +----------------------------------------------------------------------+\r\n*/\r\nvar liveSearchReq = false;\r\nvar t = null;\r\nvar liveSearchLast = \"\";\r\nvar isIE = false;\r\n// on !IE we only have to initialize it once\r\nif (window.XMLHttpRequest) {\r\n	liveSearchReq = new XMLHttpRequest();\r\n	newMastheadReq = new XMLHttpRequest();\r\n}\r\nfunction liveSearchInit() {\r\n\r\n	// Turns off autocomplete on the input element\r\n	var searchInput = document.getElementById(\'livesearch\');\r\n	if( searchInput == null ) return;\r\n	searchInput.setAttribute(\'autocomplete\', \'off\');\r\n\r\n	if (navigator.userAgent.indexOf(\"Safari\") > 0) {\r\n		document.getElementById(\'livesearch\').addEventListener(\"keydown\",liveSearchKeyPress,false);\r\n	} else if (navigator.product == \"Gecko\") {\r\n		document.getElementById(\'livesearch\').addEventListener(\"keypress\",liveSearchKeyPress,false);\r\n	} else {\r\n		document.getElementById(\'livesearch\').attachEvent(\'onkeydown\',liveSearchKeyPress);\r\n		isIE = true;\r\n	}\r\n}\r\nfunction liveSearchKeyPress(event) {\r\n	if (event.keyCode == 40 )\r\n	//KEY DOWN\r\n	{\r\n		highlight = document.getElementById(\"LSHighlight\");\r\n		if (!highlight) {\r\n			try {\r\n			highlight = document.getElementById(\"LSRes\").firstChild;\r\n			} catch (exception) { }\r\n		} else {\r\n			highlight.removeAttribute(\"id\");\r\n			highlight = highlight.nextSibling;\r\n		}\r\n		if (highlight) {\r\n			highlight.setAttribute(\"id\",\"LSHighlight\");\r\n		}\r\n		if (!isIE) { event.preventDefault(); }\r\n	}\r\n	//KEY UP\r\n	else if (event.keyCode == 38 ) {\r\n		highlight = document.getElementById(\"LSHighlight\");\r\n		if (!highlight) {\r\n			try {\r\n			highlight = document.getElementById(\"LSRes\").lastChild;\r\n			} catch (exception) {}\r\n		}\r\n		else {\r\n			highlight.removeAttribute(\"id\");\r\n			highlight = highlight.previousSibling;\r\n		}\r\n		if (highlight) {\r\n				highlight.setAttribute(\"id\",\"LSHighlight\");\r\n		}\r\n		if (!isIE) { event.preventDefault(); }\r\n	}\r\n	//ESC\r\n	else if (event.keyCode == 27) {\r\n		highlight = document.getElementById(\"LSHighlight\");\r\n		if (highlight) {\r\n			highlight.removeAttribute(\"id\");\r\n		}\r\n		document.getElementById(\"LSResult\").style.display = \"none\";\r\n		document.forms.searchform.q.value = \'\';\r\n	}\r\n	//ENTER\r\n	else if (event.keyCode == 13) {\r\n		liveSearchSubmit();\r\n	}\r\n\r\n}\r\nfunction closeLiveSearch() {\r\n	highlight = document.getElementById(\"LSHighlight\");\r\n	if (highlight) {\r\n		highlight.removeAttribute(\"id\");\r\n	}\r\n	document.getElementById(\"LSResult\").style.display = \"none\";\r\n	document.forms.searchform.q.value = \'\';\r\n}\r\nfunction liveSearchStart() {\r\n	if (t) { window.clearTimeout(t); }\r\n	t = window.setTimeout(\"liveSearchDoSearch()\",200);\r\n}\r\nfunction liveSearchDoSearch() {\r\n	if (liveSearchLast != document.forms.searchform.q.value) {\r\n	if (liveSearchReq && liveSearchReq.readyState < 4) {\r\n		liveSearchReq.abort();\r\n	}\r\n	if ( document.forms.searchform.q.value == \"\") {\r\n		document.getElementById(\"LSResult\").style.display = \"none\";\r\n		highlight = document.getElementById(\"LSHighlight\");\r\n		if (highlight) {\r\n			highlight.removeAttribute(\"id\");\r\n		}\r\n		return false;\r\n	}\r\n	if (window.XMLHttpRequest) {\r\n	// branch for IE/Windows ActiveX version\r\n	} else if (window.ActiveXObject) {\r\n		liveSearchReq = new ActiveXObject(\"Microsoft.XMLHTTP\");\r\n	}\r\n	liveSearchReq.onreadystatechange= liveSearchProcessReqChange;\r\n	liveSearchReq.open(\"GET\", \"\r\nEOF;\r\n\r\necho $pfr;\r\n\r\necho <<<EOF\r\n?ls=\" + document.forms.searchform.q.value);\r\n	liveSearchLast = document.forms.searchform.q.value;\r\n	liveSearchReq.send(null);\r\n	}\r\n}\r\nfunction liveSearchProcessReqChange() {\r\n	if (liveSearchReq.readyState == 4) {\r\n		var res = document.getElementById(\"LSResult\");\r\n		res.style.display = \"block\";\r\n		res.firstChild.innerHTML = \'<div id=\"LSHeader\"><div style=\"float:left;\">arrows and enter</div><div style=\"float:right;\"><a href=\"javascript://\" title=\"Close results\" onclick=\"closeLiveSearch()\">close (esc)</a></div><br /></div>\'+liveSearchReq.responseText;//;\r\n	}\r\n}\r\nfunction liveSearchSubmit() {\r\n	var highlight = document.getElementById(\"LSHighlight\");\r\n	if (highlight && highlight.firstChild) {\r\n		window.location = highlight.firstChild.getAttribute(\"href\");\r\n		return false;\r\n	} else {\r\n		var searchInput = document.getElementById(\'searchform\');\r\n	  searchInput.submit();\r\n		return false;\r\n	}\r\n}\r\n\r\nfunction addLoadEvent(func) {\r\n  var oldonload = window.onload;\r\n  if (typeof window.onload != \'function\') {\r\n    window.onload = func;\r\n  } else {\r\n    window.onload = function() {\r\n      oldonload();\r\n      func();\r\n    }\r\n  }\r\n}\r\n\r\naddLoadEvent(function() {\r\n  liveSearchInit();\r\n});\r\nEOF;\r\nexit;\r\n}\r\n','\n/*\nrss_live_search plugin for Textpattern\n    <URL: http://www.wilshireone.com/textpattern-plugins/rss-live-search>\nbased on LiveSearch Extension for Textpattern, Markus Kniebes\n		<URL: mailto:mk@kniebes.net>\nbased on BitFlux LiveSearch Solution\n		<URL: http://blog4.bitflux.ch/wiki/LiveSearch>\n*/\n\nfunction rss_live_search_js() {\n	return \'<script type=\"text/javascript\" src=\"\'.hu.\'?file=livesearch\"></script>\';\n}\n\nfunction rss_live_search($atts) {\n\n  extract(lAtts(array(\n    \'max\'        => 20,\n    \'excerpts\' => \'0\',\n    \'label\' => \'LiveSearch: \',\n    \'notfound\' => \'No Results Found.\',\n    \'searchto\' => \'\',\n    \'autocompleteoff\' => \'0\',\n    \'showdate\' => \'0\',\n    \'form\' => \'\',\n    \'inputvalue\' => \'\',\n    \'inputsize\' => \'20\',\n    \'showbutton\' => \'0\',\n    \'buttonval\' => \'Submit\'\n  ),$atts));\n\nif (gps(\'ls\') != \"\") {\n    function livesearch( $q, $max, $doExc, $notfound, $showdate, $form) {\n        global $prefs;\n        extract($prefs);\n\n				$s_filter = \"\";\n				$rs = safe_column(\"name\", \"txp_section\", \"searchable != \'1\'\");\n				if ($rs) {\n					foreach($rs as $name) $filters[] = \"and Section != \'$name\'\";\n					$s_filter =  join(\' \',$filters);\n				}\n\n        ob_start();\n        header( \"Content-Type: text/xml\" );\n        print \'<?xml version=\\\'1.0\\\' encoding=\\\'utf-8\\\'  ?>\';\n\n				$where = \"(Title rlike \'$q\' or Body rlike \'$q\') $s_filter and Status = 4 and Posted <=now() order by score desc limit $max\";\n        $rs = safe_rows(\n            \"*, ID as thisid, unix_timestamp(Posted) as posted, Title as title, match (Title,Body) against (\'$q\') as score\",\n            \"textpattern\", $where);\n\n				if ($form) {\n					if ($rs) {\n            $o = array();\n            $o[] = \'<div id=\"LSRes\">\';\n						foreach($rs as $a) {\n							extract($a);\n							populateArticleData($a);\n							$article = fetch(\'Form\', \'txp_form\', \'name\', $form);\n							$o[] = \'<div class=\"LSRow\">\'.parse($article).\'</div>\';\n							unset($GLOBALS[\'thisarticle\']);\n						}\n						$o[] = \'</div>\';\n					} else {\n        	$o[] = $notfound;\n        	}\n					print (is_array($o)) ? implode( \"\", $o ) : \'\';\n   				exit;\n				}\n\n        if( $rs ) {\n            $o = array();\n            $o[] = \'<div id=\"LSRes\">\';\n            foreach($rs as $a) {\n                extract($a);\n								populateArticleData($a);\n								$hurl = permlinkurl($a);\n\n                if( $doExc ) {\n                    $result = preg_replace(\"/>\\s*</\",\"> <\",$Body_html);\n                    preg_match_all(\"/\\s.{0,50}\".$q.\".{0,50}\\s/i\",$result,$concat);\n                    $concat = implode(\" ... \",$concat[0]);\n                    $concat = strip_tags($concat);\n                    $concat = preg_replace(\'/^[^>]+>/U\',\"\",$concat);\n                    $concat = preg_replace(\"/($q)/i\",\"<strong>$1</strong>\",$concat);\n                    $result_excerpt = ($concat) ? \"... \".$concat.\" ...\" : \'\';\n                    $Title = \'<strong>\'.$Title.\'</strong>\';\n                }\n								$sd = ($showdate) ? \'<span class=\"lsDate\">\'.strftime($archive_dateformat,$uPosted).\'</span>\' : \'\';\n                $o[] = \'<div class=\"LSRow\"><a href=\"\'.$hurl.\'\">\'.$Title.\'</a>\'.$sd.\'</div>\';\n                if( $doExc ) {\n                    $o[] = \'<br />\';\n                    $o[] = $result_excerpt;\n                }\n            }\n            $o[] = \'</div>\';\n        } else {\n        	$o[] = $notfound;\n        }\n        print (is_array($o)) ? implode( \"\", $o ) : \'\';\n    }\n\n	exit(livesearch(gps(\'ls\'), $max, $excerpts, $notfound, $showdate, $form));\n}\n\n$ac = ($autocompleteoff) ? \'autocomplete=\"off\" \' : \'\';\n\nif ($inputvalue != \"\") {\n	$input = \'\n	<input id=\"livesearch\" name=\"q\" value=\"\'.$inputvalue.\'\" onkeypress=\"liveSearchStart()\"\n	size=\"\'.$inputsize.\'\" onblur=\"if (this.value == \\\'\\\') {this.value = \\\'\'.$inputvalue.\'\\\';}\"\n	onfocus=\"if (this.value == \\\'\'.$inputvalue.\'\\\') {this.value = \\\'\\\';}\" \'.$ac.\' />\';\n} else {\n	$input = \'<input id=\"livesearch\" name=\"q\" onkeypress=\"liveSearchStart()\" size=\"\'.$inputsize.\'\" \'.$ac.\' />\';\n}\n\n$sbtn = ($showbutton) ? \'<input type=\"submit\" id=\"livesearchsubmit\" value=\"\'.$buttonval.\'\" />\' : \'\';\n\nreturn \'<form id=\"searchform\" name=\"searchform\" method=\"get\" action=\"\'.hu.$searchto.\'\" onsubmit=\"return liveSearchSubmit()\">\n				<label>\'.$label.$input.\'</label>\'.$sbtn.\'<br/>\n				<div id=\"LSResult\" style=\"display: none;\"><div id=\"LSShadow\"></div></div>\n			</form>\';\n}\n\nif (gps(\'file\') == \'livesearch\') {\nglobal $pfr;\necho <<<EOF\n/*\n// +----------------------------------------------------------------------+\n// | Copyright (c) 2004 Bitflux GmbH                                      |\n// +----------------------------------------------------------------------+\n// | Licensed under the Apache License, Version 2.0 (the \"License\");      |\n// | you may not use this file except in compliance with the License.     |\n// | You may obtain a copy of the License at                              |\n// | http://www.apache.org/licenses/LICENSE-2.0                           |\n// | Unless required by applicable law or agreed to in writing, software  |\n// | distributed under the License is distributed on an \"AS IS\" BASIS,    |\n// | WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or      |\n// | implied. See the License for the specific language governing         |\n// | permissions and limitations under the License.                       |\n// +----------------------------------------------------------------------+\n// | Author: Bitflux GmbH <devel@bitflux.ch>                              |\n// +----------------------------------------------------------------------+\n*/\nvar liveSearchReq = false;\nvar t = null;\nvar liveSearchLast = \"\";\nvar isIE = false;\n// on !IE we only have to initialize it once\nif (window.XMLHttpRequest) {\n	liveSearchReq = new XMLHttpRequest();\n	newMastheadReq = new XMLHttpRequest();\n}\nfunction liveSearchInit() {\n\n	// Turns off autocomplete on the input element\n	var searchInput = document.getElementById(\'livesearch\');\n	if( searchInput == null ) return;\n	searchInput.setAttribute(\'autocomplete\', \'off\');\n\n	if (navigator.userAgent.indexOf(\"Safari\") > 0) {\n		document.getElementById(\'livesearch\').addEventListener(\"keydown\",liveSearchKeyPress,false);\n	} else if (navigator.product == \"Gecko\") {\n		document.getElementById(\'livesearch\').addEventListener(\"keypress\",liveSearchKeyPress,false);\n	} else {\n		document.getElementById(\'livesearch\').attachEvent(\'onkeydown\',liveSearchKeyPress);\n		isIE = true;\n	}\n}\nfunction liveSearchKeyPress(event) {\n	if (event.keyCode == 40 )\n	//KEY DOWN\n	{\n		highlight = document.getElementById(\"LSHighlight\");\n		if (!highlight) {\n			try {\n			highlight = document.getElementById(\"LSRes\").firstChild;\n			} catch (exception) { }\n		} else {\n			highlight.removeAttribute(\"id\");\n			highlight = highlight.nextSibling;\n		}\n		if (highlight) {\n			highlight.setAttribute(\"id\",\"LSHighlight\");\n		}\n		if (!isIE) { event.preventDefault(); }\n	}\n	//KEY UP\n	else if (event.keyCode == 38 ) {\n		highlight = document.getElementById(\"LSHighlight\");\n		if (!highlight) {\n			try {\n			highlight = document.getElementById(\"LSRes\").lastChild;\n			} catch (exception) {}\n		}\n		else {\n			highlight.removeAttribute(\"id\");\n			highlight = highlight.previousSibling;\n		}\n		if (highlight) {\n				highlight.setAttribute(\"id\",\"LSHighlight\");\n		}\n		if (!isIE) { event.preventDefault(); }\n	}\n	//ESC\n	else if (event.keyCode == 27) {\n		highlight = document.getElementById(\"LSHighlight\");\n		if (highlight) {\n			highlight.removeAttribute(\"id\");\n		}\n		document.getElementById(\"LSResult\").style.display = \"none\";\n		document.forms.searchform.q.value = \'\';\n	}\n	//ENTER\n	else if (event.keyCode == 13) {\n		liveSearchSubmit();\n	}\n\n}\nfunction closeLiveSearch() {\n	highlight = document.getElementById(\"LSHighlight\");\n	if (highlight) {\n		highlight.removeAttribute(\"id\");\n	}\n	document.getElementById(\"LSResult\").style.display = \"none\";\n	document.forms.searchform.q.value = \'\';\n}\nfunction liveSearchStart() {\n	if (t) { window.clearTimeout(t); }\n	t = window.setTimeout(\"liveSearchDoSearch()\",200);\n}\nfunction liveSearchDoSearch() {\n	if (liveSearchLast != document.forms.searchform.q.value) {\n	if (liveSearchReq && liveSearchReq.readyState < 4) {\n		liveSearchReq.abort();\n	}\n	if ( document.forms.searchform.q.value == \"\") {\n		document.getElementById(\"LSResult\").style.display = \"none\";\n		highlight = document.getElementById(\"LSHighlight\");\n		if (highlight) {\n			highlight.removeAttribute(\"id\");\n		}\n		return false;\n	}\n	if (window.XMLHttpRequest) {\n	// branch for IE/Windows ActiveX version\n	} else if (window.ActiveXObject) {\n		liveSearchReq = new ActiveXObject(\"Microsoft.XMLHTTP\");\n	}\n	liveSearchReq.onreadystatechange= liveSearchProcessReqChange;\n	liveSearchReq.open(\"GET\", \"\nEOF;\n\necho $pfr;\n\necho <<<EOF\n?ls=\" + document.forms.searchform.q.value);\n	liveSearchLast = document.forms.searchform.q.value;\n	liveSearchReq.send(null);\n	}\n}\nfunction liveSearchProcessReqChange() {\n	if (liveSearchReq.readyState == 4) {\n		var res = document.getElementById(\"LSResult\");\n		res.style.display = \"block\";\n		res.firstChild.innerHTML = \'<div id=\"LSHeader\"><div style=\"float:left;\">use arrow keys &amp; enter</div><div style=\"float:right;\"><a href=\"javascript://\" title=\"Close results\" onclick=\"closeLiveSearch()\">close (esc)</a></div><br /></div>\'+liveSearchReq.responseText;//;\n	}\n}\nfunction liveSearchSubmit() {\n	var highlight = document.getElementById(\"LSHighlight\");\n	if (highlight && highlight.firstChild) {\n		window.location = highlight.firstChild.getAttribute(\"href\");\n		return false;\n	} else {\n		var searchInput = document.getElementById(\'searchform\');\n	  searchInput.submit();\n		return false;\n	}\n}\n\nfunction addLoadEvent(func) {\n  var oldonload = window.onload;\n  if (typeof window.onload != \'function\') {\n    window.onload = func;\n  } else {\n    window.onload = function() {\n      oldonload();\n      func();\n    }\n  }\n}\n\naddLoadEvent(function() {\n  liveSearchInit();\n});\nEOF;\nexit;\n}\n','4d80b033cb85fa858327ec8244426401',0),('zem_contact',1,'Threshold State','http://thresholdstate.com/','0.6','Flexible email contact/feedback form','\n<code>&lt;txp:zem_contact&gt;</code> produces a flexible, customizable email contact form.  It&#8217;s intended for use as an enquiry form for commercial sites, and includes several features to help reduce common problems with such forms (invalid email addresses, missing information).\n\n	<h3>Features:</h3>\n\n	<ul>\n	<li>Arbitrary text fields can be specified, with min/max/required settings for validation</li>\n		<li>Email address validation, including a check for a valid MX record (Unix only)</li>\n		<li>Safe escaping of input data</li>\n		<li>Accessible form layout, including <code>&lt;label&gt;</code> tags</li>\n		<li>Spam prevention</li>\n	</ul>\n\n	<h3>Examples:</h3>\n\n	<p>The simplest form is this:</p>\n\n	<blockquote>\n		<p><code>&lt;txp:zem_contact mailto=\"dest@example.com\" /&gt;</code></p>\n	</blockquote>\n\n	<p>..which produces a default form with Name, Email and Message fields.  Email will be delivered to dest@example.com, with the user&#8217;s supplied email as the <code>From:</code> address.</p>\n\n	<p>To specify fields explicitly, use something like this:</p>\n\n	<blockquote>\n		<p><code>&lt;txp:zem_contact mailto=\"dest@example.com\"&gt;<br />\n&lt;txp:zem_contact_email /&gt;&lt;br /&gt;<br />\n&lt;txp:zem_contact_text label=\"Phone\" min=7 /&gt;&lt;br /&gt;<br />\n&lt;txp:zem_contact_textarea label=\"Enquiry\" /&gt;&lt;br /&gt;<br />\n&lt;txp:zem_contact_submit label=\"Enquire\" /&gt;<br />\n&lt;/txp:zem_contact&gt;<br />\n</code></p>\n	</blockquote>\n\n	<p>Alternatively, place the field specifications in a Textpattern form, and call it like this:</p>\n\n<pre><code>\n&lt;txp:zem_contact mailto=\"dest@example.com\" form=\"mycontactform\" /&gt;\n</code></pre>\n\n	<h3>Tags</h3>\n\n	<blockquote>\n		<p><code>&lt;txp:zem_contact /&gt;</code></p>\n	</blockquote>\n\n	<p>May be used as a self-closing or container tag.  Place this where you want the input form to go.  Status and error messages, if any, will be displayed before the form.  Attributes:</p>\n\n	<ul>\n	<li><strong>mailto</strong> &#8211; destination address.  Required.</li>\n		<li><strong>form</strong> &#8211; form containing the field layout.  Optional.</li>\n		<li><strong>mailfrom</strong> &#8211; use the specified email address in the &#8220;From:&#8221; field when sending email.  If no <code>mailfrom</code> is specified, the sender&#8217;s email address will be used.  When <code>mailfrom</code> is specified, the sender&#8217;s email address will be placed in the &#8220;Reply-To:&#8221; field instead.</li>\n		<li><strong>thanksform</strong> &#8211; The name of a form containing a thankyou message.  Optional.</li>\n		<li><strong>showinput</strong> &#8211; Use <code>showinput=0</code> to disable display of the input form.  Optional.</li>\n		<li><strong>showerror</strong> &#8211; Use <code>showerror=0</code> to disable display of error and status messages.  Optional.</li>\n	</ul>\n\n<code>showinput</code> and <code>showerror</code> can be used to display the form and error/thankyou messages on different parts of a page.  For example:\n\n	<blockquote>\n		<p><code>&lt;div id=\"error\"&gt;&lt;txp:zem_contact form=\"contact_form\" showinput=0 /&gt;&lt;/div&gt;</code><br />\n<code>&lt;div id=\"inputform\"&gt;&lt;txp:zem_contact form=\"contact_form\" showerror=0 /&gt;&lt;/div&gt;</code></p>\n	</blockquote>\n\n	<p>The remaining tags may only be used within a <code>&lt;txp:zem_contact&gt;</code> form or container:</p>\n\n	<blockquote>\n		<p><code>&lt;txp:zem_contact_text /&gt;</code></p>\n	</blockquote>\n\n	<p>Creates a text input field and corresponding <code>&lt;label&gt;</code> tag.  The input value will be included in the email, preceeded by the label.  Attributes:</p>\n\n	<ul>\n	<li><strong>label</strong> &#8211; Text label displayed to the user.  Default is &#8216;Text&#8217;.</li>\n		<li><strong>name</strong> &#8211; Field name, as used in the HTML input tag.  Optional, defaults to the <code>label</code>.</li>\n		<li><strong>break</strong> &#8211; Break tag between the label and field.  Default is <code>&lt;br /&gt;</code>.  Use <code>break=\'\'</code> to put the label and input field on the same line.</li>\n		<li><strong>size</strong> &#8211; Size of the input field as displayed to the user.  Leave empty for the browser default.</li>\n		<li><strong>required</strong> &#8211; Use <code>required=1</code> to make the field mandatory.  The text label will be displayed in bold, and the form will display an error message if no input is provided.  Optional.</li>\n		<li><strong>min</strong> &#8211; Minimum input length in characters.  An error message will be displayed if the input is less than <code>min</code>.  Optional, default is 0.</li>\n		<li><strong>max</strong> &#8211; Maximum input length in characters.  Used for the <code>maxlength</code> parameter of the input field.  No error will be displayed if the length is exceeded, but the value will be truncated for the email.  Optional, default is 100.</li>\n		<li><strong>default</strong> &#8211; Default value when no input is provided.  Optional.</li>\n	</ul>\n\n	<blockquote>\n		<p><code>&lt;txp:zem_contact_email /&gt;</code></p>\n	</blockquote>\n\n	<p>Input field for user&#8217;s email address.  The input value will automatically be validated to make sure it is of the form &#8216;abc@xxx.yyy[.zzz]&#8217;.  If the Unix-only <code>getmxrr()</code> function is available, the form will verify that an A or MX record exists for the domain.  Attributes are the same as for <code>&lt;txp:zem_contact_text /&gt;</code>, except that the default label is &#8216;Email&#8217;, and <code>required=1</code>.</p>\n\n	<blockquote>\n		<p><code>&lt;txp:zem_contact_select /&gt;</code></p>\n	</blockquote>\n\n	<p>Creates a drop-down selection list.  Attributes are similar to <code>&lt;txp:zem_contact_text /&gt;</code>, with the following additions:</p>\n\n	<ul>\n	<li><strong>list</strong> &#8211; A comma separated list of items to show in the drop-down box; e.g. &#8220;Sales,Support,Accounts&#8221;.</li>\n		<li><strong>delim</strong> &#8211; The separator used in parsing the <strong>list</strong> attribute.  Default is &#8221;,&#8221;</li>\n		<li><strong>selected</strong> &#8211; The list item that is selected by default; e.g. &#8220;Support&#8221;.  Default is &#8220;&#8221;.</li>\n	</ul>\n\n	<p><strong>min</strong> and <strong>max</strong> have no effect.  If <strong>required</strong> is used, an empty item will not be accepted.  Use <code>&lt;txp:zem_contact_select list=\",Sales,Support\" required=1 /&gt;</code> to make the first item blank, and require that the user select either Sales or Support.</p>\n\n	<blockquote>\n		<p><code>&lt;txp:zem_contact_checkbox /&gt;</code></p>\n	</blockquote>\n\n	<p>Creates a checkbox.  Attributes are similar to <code>&lt;txp:zem_contact_text /&gt;</code>, except that <strong>min</strong> and <strong>max</strong> have no effect.</p>\n\n	<ul>\n	<li><strong>checked</strong> &#8211; Use <code>checked=1</code> to make the box checked when the form is first displayed.  Default is 0.</li>\n	</ul>\n\n	<p>If <strong>required</strong> is used, the form won&#8217;t be accepted unless the box is checked.  Use <code>&lt;txp:zem_contact_checkbox label=\"I accept the terms and conditions\" required=1 /&gt;</code> to make a crude shrinkwrap agreement.</p>\n\n	<blockquote>\n		<p><code>&lt;txp:zem_contact_textarea /&gt;</code></p>\n	</blockquote>\n\n	<p>Textarea input field.  Supports the same attributes as <code>&lt;txp:zem_content_text /&gt;</code>, with the exception of <code>size</code>.  The default label is &#8216;Message&#8217;, and the default <code>max</code> is 10000.  Additional attributes:</p>\n\n	<ul>\n	<li><strong>cols</strong> &#8211; column width.  Optional, default is 50.</li>\n		<li><strong>rows</strong> &#8211; row height.  Optional, default is 6.</li>\n	</ul>\n\n	<blockquote>\n		<p><code>&lt;txp:zem_contact_submit /&gt;</code></p>\n	</blockquote>\n\n	<p>Submit button.  Attributes:</p>\n\n	<ul>\n	<li><strong>label</strong> &#8211; Button text.  Default is &#8216;Send&#8217;.</li>\n	</ul>\n\n	<blockquote>\n		<p><code>&lt;txp:zem_contact_serverinfo /&gt;</code></p>\n	</blockquote>\n\n	<p>This tag has no effect on the form or HTML output, but will include additional information in the email based on the PHP <code>$_SERVER</code> variable.  For example, <code>&lt;txp:zem_contact_serverinfo name=\"REMOTE_ADDR\" label=\"IP\" /&gt;</code> will report the user&#8217;s IP address.  Attributes:</p>\n\n	<ul>\n	<li><strong>name</strong> &#8211; name of the server variable, e.g. REQUEST_URI, HTTP_USER_AGENT.  See the <a href=\"http://www.php.net/manual/en/reserved.variables.php#reserved.variables.server\">PHP manual</a> for a full list.  Required.</li>\n		<li><strong>label</strong> &#8211; if supplied, this will be used to identify the field in the email.  Optional.</li>\n	</ul>\n\n\n\n\n ','\nfunction zem_contact($atts, $thing=\'\') {\n	global $zem_contact_error, $sitename, $zem_contact_from, $zem_contact_nonce, $zem_contact_form;\n\n	$form = (empty($atts[\'form\']) ? \'\' : $atts[\'form\']);\n	$thanksform = (empty($atts[\'thanksform\']) ? \'\' : $atts[\'thanksform\']);\n	$thanks = (empty($atts[\'thanks\']) ? \'<p>Email enquiry sent</p>\' : $atts[\'thanks\']);\n	$mailto = (empty($atts[\'mailto\']) ? \'\' : $atts[\'mailto\']);\n	$mailfrom = (empty($atts[\'mailfrom\']) ? \'\' : $atts[\'mailfrom\']);\n	$showinput = isset($atts[\'showinput\']) ? $atts[\'showinput\'] : 1;\n	$showerror = isset($atts[\'showerror\']) ? $atts[\'showerror\'] : 1;\n\n	if (!$mailto)\n		return \'No mailto address specified\';\n\n	if ($form)\n		$Form = fetch(\"Form\",\"txp_form\",\"name\",$form);\n	else\n		$form = $thing;\n\n	if (empty($form)) {\n		$form =<<<EOF\n<txp:zem_contact_text label=\"Name\" /><br />\n<txp:zem_contact_email /><br />\n<txp:zem_contact_textarea /><br />\n<txp:zem_contact_submit />\nEOF;\n	}\n\n	if ($thanksform)\n		$thanks = fetch(\"Form\",\"txp_form\",\"name\",$thanksform);\n\n	$zem_contact_nonce = md5(uniqid(rand(), true));\n	safe_insert(\"txp_discuss_nonce\", \"issue_time=now(), nonce=\'$zem_contact_nonce\'\");\n\n	$f = parse($form);\n\n	$out = \'\';\n	if (is_array($zem_contact_error) and count($zem_contact_error)) {\n		if ($showerror) {\n			$out .= \"<ul>\\n\";\n			foreach($zem_contact_error as $err) {\n				$out .= \"<li>$err</li>\\n\";\n			}\n			$out .= \"</ul>\\n\";\n		}\n	}\n	elseif ($showinput and is_array($zem_contact_form) and ps(\'zem_contact_submit\')) {\n\n		$from = ($mailfrom ? $mailfrom : $zem_contact_from);\n		$headers = (empty($from) ? \'\' : \"From: $from\\r\\n\");\n		if ($mailfrom)\n			$headers .= \"Reply-To: $zem_contact_from\\r\\n\";\n 		$headers .= \"Content-Transfer-Encoding: 8bit\\r\\n\";\n 		$headers .= \"Content-Type: text/plain; charset=\\\"UTF-8\\\"\\r\\n\";\n\n		$msg = \'\';\n		foreach ($zem_contact_form as $k=>$v)\n			$msg .= \"$k: \".htmlspecialchars($v).\"\\n\";\n		$r = mail($mailto, \"Email enquiry for $sitename\", $msg, $headers);\n\n		if ($r) {\n			$_POST = array();\n			$out .= $thanks;\n			$f = parse($form);\n		}\n		else {\n			$out .= \"<p>Unable to send email</p>\";\n		}\n	}\n\n	if ($showinput)\n		$out .= \'<form action=\"\'.$_SERVER[\'REQUEST_URI\'].\'\" method=\"post\">\'\n			. $f\n			. \'</form>\';\n\n	return $out;\n}\n\nfunction zem_contact_text($atts) {\n	global $zem_contact_error, $zem_contact_form;\n	$label = (empty($atts[\'label\']) ? \'Text\' : $atts[\'label\']);\n	$name = (empty($atts[\'name\']) ? preg_replace(\'/\\W/\', \'\', $label) : $atts[\'name\']);\n	$break = (!isset($atts[\'break\']) ? \'<br />\' : $atts[\'break\']);\n	$size = (empty($atts[\'size\']) ? \'\' : $atts[\'size\']);\n	$min = (empty($atts[\'min\']) ? 0 : $atts[\'min\']);\n	$max = (!isset($atts[\'max\']) ? 100 : $atts[\'max\']);\n	$default = (empty($atts[\'default\']) ? \'\' : $atts[\'default\']);\n	$required = (empty($atts[\'required\']) ? false : true);\n\n	$size = ($size ? \'size=\"\'.(int)$size.\'\"\' : \'\');\n	$maxlength = ($max ? \'maxlength=\"\'.(int)$max.\'\"\' : \'\');\n\n	$default = ($default ? \'value=\"\'.$default.\'\"\' : \'\');\n	$v = (ps($name) ? ps($name) : $default);\n\n	if ($v and $max)\n		$v = substr($v, 0, $max);\n\n	if (ps(\'zem_contact_submit\') and $required and empty($v))\n		$zem_contact_error[] = \"Required field $label is missing\";\n	elseif (ps($name) and $min and strlen($v) < $min)\n		$zem_contact_error[] = \"$label must be at least $min characters\";\n	elseif (ps($name))\n		$zem_contact_form[$label] = $v;\n\n	$l = ($required ? \"<b>$label</b>\" : $label);\n\n	return \'<label for=\"\'.$name.\'\">\'.$l.\':</label>\'.\n		$break.\n		\'<input type=\"text\" name=\"\'.$name.\'\" id=\"\'.$name.\'\" value=\"\'.htmlentities($v).\'\" \'.$size.\' \'.$maxlength.\' />\';\n}\n\nfunction zem_contact_textarea($atts) {\n	global $zem_contact_error, $zem_contact_form;\n	$label = (empty($atts[\'label\']) ? \'Message\' : $atts[\'label\']);\n	$name = (empty($atts[\'name\']) ? preg_replace(\'/\\W/\', \'\', $label) : $atts[\'name\']);\n	$break = (!isset($atts[\'break\']) ? \'<br />\' : $atts[\'break\']);\n	$cols = (empty($atts[\'cols\']) ? \'50\' : $atts[\'cols\']);\n	$rows = (empty($atts[\'rows\']) ? \'6\' : $atts[\'rows\']);\n	$min = (empty($atts[\'min\']) ? 0 : $atts[\'min\']);\n	$max = (!isset($atts[\'max\']) ? 10000 : $atts[\'max\']);\n	$default = (empty($atts[\'default\']) ? \'\' : $atts[\'default\']);\n	$required = (empty($atts[\'required\']) ? false : true);\n\n	$v = (ps($name) ? ps($name) : $default);\n	if (ps($name) and $max)\n		$v = substr($v, 0, $max);\n\n	if (ps(\'zem_contact_submit\') and $required and empty($v))\n		$zem_contact_error[] = \"Required field $label is missing\";\n	elseif (ps($name) and $min and strlen($v) < $min)\n		$zem_contact_error[] = \"$label must be at least $min characters\";\n	elseif (ps($name))\n		$zem_contact_form[$label] = $v;\n\n	$l = ($required ? \"<b>$label</b>\" : $label);\n	return \'<label for=\"\'.$name.\'\">\'.$l.\':</label>\'.\n		$break.\n		\'<\'.\'textarea name=\"\'.$name.\'\" id=\"\'.$name.\'\" rows=\"\'.$rows.\'\" cols=\"\'.$cols.\'\">\'.htmlentities($v).\'<\'.\'/textarea>\';\n}\n\nfunction zem_contact_email($atts) {\n	global $zem_contact_error, $zem_contact_form, $zem_contact_from;\n	$atts = array_merge(array(\'label\'=>\'Email\', \'required\'=>\'1\'), $atts);\n	$label = (empty($atts[\'label\']) ? \'Email\' : $atts[\'label\']);\n	$name = (empty($atts[\'name\']) ? preg_replace(\'/\\W/\', \'\', $label) : $atts[\'name\']);\n\n	if (ps(\'zem_contact_submit\')) {\n		$email = ps($name);\n		if (!preg_match(\'/^[\\w._-]+@([\\w-]+\\.)+[\\w-]+$/\', $email))\n			$zem_contact_error[] = \"\'$email\' is not a valid email address\";\n		elseif (preg_match(\"/@(.+)$/\", $email, $match)) {\n			$domain = $match[1];\n			$mx = 0;\n			if (is_callable(\'getmxrr\')) {\n				$dummy = array();\n				$mx = @getmxrr($domain, $mx);\n			}\n\n			if (!$mx and (@gethostbyname($domain) == $domain))\n				$zem_contact_error[] = \"Domain \'$domain\' is not a valid email host\";\n			else\n				$zem_contact_from = $email;\n		}\n		else\n			$zem_contact_from = $email;\n	}\n\n	return zem_contact_text($atts);\n}\n\nfunction zem_contact_select($atts) {\n	global $zem_contact_error, $zem_contact_form;\n	$delim = empty($atts[\'delim\']) ? \',\' : $atts[\'delim\'];\n	$list = empty($atts[\'list\']) ? \'General enquiry\' : $atts[\'list\'];\n	$selected = empty($atts[\'selected\']) ? \'\' : $atts[\'selected\'];\n	$label = (empty($atts[\'label\']) ? \'Option\' : $atts[\'label\']);\n	$name = (empty($atts[\'name\']) ? preg_replace(\'/\\W/\', \'\', $label) : $atts[\'name\']);\n	$break = (!isset($atts[\'break\']) ? \'<br />\' : $atts[\'break\']);\n	$required = (empty($atts[\'required\']) ? false : true);\n\n	$list = split($delim, $list);\n	$list = array_map(\'trim\', $list);\n\n	$v = (ps($name) ? ps(name) : $selected);\n	if (ps(\'zem_contact_submit\') and $required and empty($v))\n		$zem_contact_error[] = \"Required field $label is missing\";\n	elseif (ps($name) and !in_array($v, $list))\n		$zem_contact_error[] = \"Unknown $label $v\";\n	elseif (ps($name))\n		$zem_contact_form[$label] = $v;\n\n	$out = \'\';\n	for ($i=0; $i < count($list); $i++) {\n		if ($list[$i] == $selected)\n			$out .= \'<option selected=1>\'.$list[$i].\"</option>\\n\";\n		else\n			$out .= \'<option>\'.$list[$i].\"</option>\\n\";\n	}\n\n	$l = ($required ? \"<b>$label</b>\" : $label);\n	return \'<label for=\"\'.$name.\'\">\'.$l.\':</label>\'.\n		$break.\n		\'<select name=\"\'.$name.\'\">\'.$out.\'</select>\';\n}\n\nfunction zem_contact_checkbox($atts) {\n	global $zem_contact_error, $zem_contact_form;\n\n	$label = (empty($atts[\'label\']) ? \'Checkbox\' : $atts[\'label\']);\n	$name = (empty($atts[\'name\']) ? preg_replace(\'/\\W/\', \'\', $label) : $atts[\'name\']);\n	$break = (!isset($atts[\'break\']) ? \'<br />\' : $atts[\'break\']);\n	$checked = empty($atts[\'checked\']) ? 0 : 1;\n	$required = (empty($atts[\'required\']) ? false : true);\n\n	$v = (ps(\'zem_contact_submit\') ? (bool)ps($name) : \'\');\n\n	if (ps(\'zem_contact_submit\') and $required and empty($v))\n		$zem_contact_error[] = \"Required field $label is missing\";\n	elseif (ps(\'zem_contact_submit\'))\n		$zem_contact_form[$label] = ($v ? \'Yes\' : \'No\');\n\n	$l = ($required ? \"<b>$label</b>\" : $label);\n	return \'<input type=\"checkbox\" name=\"\'.$name.\'\"\'.\n		($checked ? \' checked=\"true\"\' : \'\').\n		\'>\'.\n		\'<label for=\"\'.$name.\'\">\'.$l.\'</label>\'.\n		$break;\n}\n\nfunction zem_contact_serverinfo($atts) {\n	global $zem_contact_error, $zem_contact_form;\n\n	$name = (empty($atts[\'name\']) ? \'\' : $atts[\'name\']);\n	$label = (empty($atts[\'label\']) ? $name : $atts[\'label\']);\n\n	if ($name and ps(\'zem_contact_submit\'))\n		$zem_contact_form[$label] = serverSet($name);\n}\n\nfunction zem_contact_submit($atts) {\n	global $zem_contact_nonce, $zem_contact_error;\n\n	$label = (empty($atts[\'label\']) ? \'Send\' : $atts[\'label\']);\n\n	if (ps(\'zem_conta